INSERT INTO `regsys_group` (`Id`, `Name`, `Friends`, `Description`, `Enemies`, `IntrigueIdeas`, `OtherInformation`, `WealthId`, `PlaceOfResidenceId`, `PersonId`, `CampaignId`, `IsDead`, `DescriptionForOthers`) VALUES
(1, 'Aarrr!', '', 'Ett gäng pirater på fel skepp', '', '', '', 1, 1, 10, 1, 0, 'Arrangörerna för lajvet.'),
(2, 'Taggtrådsfronten', 'Potentiellt guvernören, småbönder och andra trötta på McDougalls maktmissbruk (mycket objektiv åsikt ;)).', 'Förespråkare av taggtråd vars främsta fråga är att taggtråd åter bör tillåtas. För att öka chanserna att det ska uppnås anser åtminstone delar av gruppen att en ny borgmästare bör väljas, en mindre korrupt sådan.', 'McDougalls, borgmästaren, folk som är emot taggtråd såsom stora ranchägare och guldletare.', 'Taggtrådsfronten är beredda att gå långt för att avsätta Penny, kanske även döda eller skada…?\r\nTaggtrådsfronten står upp för den lilla människans rätt - någon måste ju göra det...\r\nTaggtrådsfronten har hemliga medlemmar och hemliga möten i Slow River.', 'Vi är öppna för att bli inblandade i intriger och arrangörsstyrda vid behov. Rent off är vi inte ute efter att göra några roller ospelbara. Vi kan tänka oss att ha något lajvhemligt* möte under lajvet. *dvs ett möte som är relativt lätt att tjuvlyssna på och lagom hemligt.', 3, 1, 7, 1, 0, 'Taggtrådsfronten är en sammanslutning av framförallt småbönder som är för att taggtråd åter ska vara tillåtet. De mer högljudda inom gruppen anser också att Penny borde ersättas med en mindre korrupt borgmästare och att vissa *host* McDougalls *host* har för mycket inflytande över Slow River. Sammanslutningen kan sägas vara semihemlig då inte alla vill skylta med sitt engagemang. Det är trots allt inte riskfritt att skylta med starka åsikter i Slow River…'),
(3, 'McDougalls', 'Senatorerna ?\r\nStormarksägare\r\nFragil \"Fred\" med Five Fingers ', 'McDougalls - Familj, klan eller gäng?\r\n\r\nEtt gäng kriminella som lägger sina näsor i blöt överallt. ', 'Småbrukarna\r\nSenatorerna\r\nFragil \"fred\" med Five Fingers', 'Skrev 3 på rikedom då det är allt från 1-5 i gruppen... Mer rik än fattig...\r\n\r\n', 'Bor på sin ranch utanför SlowRiver, och i husen i byn. \r\nPga OFF-anledningar vore det väldigt behövligt med de två husen vi haft hitills (npf-diagnoser, etc, så det finns ett \"lugnt hus\" och ett socialt hus) för de specialbehov som finns bland deltagare i gruppen. \r\n', 3, 1, 8, 1, 0, 'McDougalls - Familj, klan eller gäng? \r\n\r\nDessa råbarkade kriminella element har funnits i trakten några år nu... \r\n\r\nBörjar de eventuellt gå den smala vägen, eller är det enbart en fasad? '),
(4, 'Familjen Bodecker', 'tbc\r\n\r\nBodecker som från början verkade vara en mycket välartad familj, men visade sig snart ha fingrarna i diverse smutsiga syltburkar. Nu kämpar dom för att återupprätta sitt goda rykte och status. ', 'Obs prel beskeivning (uppdateras april)\r\n\r\nFamiljen Bodecker\r\nNyinflyttade till en liten stuga strax utanför byn.\r\nVi har inte hunnit vara så sociala inne i byn än men planerar att bli det nu när vi kommit tillrätta.\r\nJunky News har nyligen varit hemma hos oss och intervjuat oss, vi är mycket nyfikna på artikeln.\r\nPrata gärna med oss och våra döttrar. Vi behöver lära känna er och er fina stad. \r\n\r\n', 'tba', '', '', 3, 1, 13, 1, 0, 'tba'),
(5, 'A&F Land survey Co.', '- Nordstatssoldater\r\n- Kunder (oftast)\r\n- Personer som upprätthåller lagen', '[Kommer expanderas/ersättas av en beskrivning med mer detaljer åt er i arr-gruppen senare]\r\n\r\nArlington & Fletcher Land survey Company - \"I framstegens fotspår marscherar vi!\"\r\n\r\nEtt företag specialicerat på lantmäteri. Bildades av en grupp krigsveteraner från New York, men har även anställt ett antal arbetare och administratörer från annat håll. Ovanligt välbeväpnade och med god vildmarksvana för att vara storstadsbor. \r\nDe erbjuder råd, löser landdispyter, utför mätningar, ritar kartor, värderar mark, handlar med markrättigheter och tar fram planer och intyg för markgränser, byggnader, inmutningar, järnvägar och dylikt både åt myndigheter och privatpersoner. \r\nFöretaget säger sig arbeta helt inom lagens ramar - men ibland kan det visa sig vara dyrt att inte ligga i vägen för civilisationens framfart. Och naturligtvis kan mätningar alltid bli \"bättre\" ju mer du betalar... \r\n\r\n', '- Sydstats-lojalister och \"lost cause\"-anhängare som vägrat lägga ned vapnen\r\n- Banditer\r\n- Rättshaverister\r\n- Lokala markägare', '', '', 4, 6, 19, 1, 0, 'Arlington & Fletcher Land survey Company - \"I framstegens fotspår marscherar vi!\"\r\n\r\nEtt företag specialicerat på lantmäteri. Bildades av en grupp krigsveteraner från New York, men har även anställt ett antal arbetare och administratörer från annat håll. Ovanligt välbeväpnade och med god vildmarksvana för att vara storstadsbor. \r\nDe erbjuder råd, löser landdispyter, utför mätningar, ritar kartor, värderar mark, handlar med markrättigheter och tar fram planer och intyg för markgränser, byggnader, inmutningar, järnvägar och dylikt både åt myndigheter och privatpersoner. \r\nFöretaget säger sig arbeta helt inom lagens ramar - men ibland kan det visa sig vara dyrt att inte ligga i vägen för civilisationens framfart. Och naturligtvis kan mätningar alltid bli \"bättre\" ju mer du betalar... '),
(6, 'Yankton\'s finest', 'Gruppen kan på det stora hela tänka sig att samarbeta med nästan vem som helst utom kanske de mest ljusskygga skurkar så länge det finns pengar att tjäna. ', 'Gruppen består av de två bröderna Poole samt deras affärspartner (namn kommer). Bröderna kommer från en medelklassbakgrund i New York och har därefter sökt sig västerut för att bli rika genom diverse entreprenörskap (både laglig företagsamhet och hasardspel). Etiskt ligger gruppen i gråzonen, det finns inga skarpa gränser för vad som går an på vägen mot framgång.', 'Individer som är för lika dem själva, konkurrenter etc., eller andra personer som står i vägen i deras affärer.', 'Eventuellt knivskar den yngre brodern Poole (Henrik Thörnqvist) en falskspelare i Denver.\r\n', 'Vi är nya vad gäller DMH men samtliga i gruppen har lajvat sen början av 2000-talet. Vi är väl inte ute efter särskilt omvälvande intriger utan vill väl mest känna lite på kampanjen i stort.', 3, 3, 26, 1, 0, 'Tillresta företagare/spelare från Yankton via Denver. Pålitliga eller rena opportunister?'),
(7, 'Revisorn och Co', 'Gruppen är vänligt inställda till de allra flesta som inte gör det tydligt att de kommer innebära ett problem. Bland Slow Rivers invånare så är de extra vänligt inställda till Magnolia Malone, Lydia O\'Neal och Five Fingers.', 'Efter att Tessie och Hilda sade upp sig från Reynards LLC så bildade de sitt eget företag. Tessie sköter revisionsarbetet och Hilda sköter allt det praktiska runt omkring så som reseplaner, boende mm. Nu reser de tillsammans över stora delar av USA, varhelst det finns jobb och har långsamt vant sig vid den nya tillvaron. Med dem så reser även ibland korttidsanställda. Utöver företagets rent ekonomiska aspekt så handlar de även än del med diverse varor som de kommer över på sina resor. De håller sig generellt inom lagens regler men kan tumma på dem om de känner sig säkra på att de kommer att komma undan med det.', 'Gruppen ogillar representanter för lag och ordning som tycker om att snoka alldeles för mycket, personer som sysslar med olagliga saker om de kan skapa problem för gruppen samt konkurrerande revisorer. Speciellt inkompetenta konkurrenter eftersom de ger alla andra ett dåligt rykte.', 'Behöver någon annan grupp hjälp med någon form av ekonomi så som att gå igenom bokföring så är vi mer än villiga att hjälpa till.', '', 3, 8, 4, 1, 0, 'Tessie och Hilda tillsammans med eventuella kompanjoner driver vad som i mångt och mycket är ett revisionsföretag. De sysslar dock även med en del handel och andra ströjobb. Vänligt inställda till de allra flesta och alltid redo att göra affärer.'),
(8, 'Minnekapi Rangers ', 'Alla laglydiga individer ', 'Minnekapi rangers är ett paramillitärt polisväsende som verkat runt om i delstaten sedan 1865. De har jurisdiktion att agera mot de som begår brott som riskerar stabiliteten i delstaten, till exempel tåg och dilligensrån, boskapstjuvar, renegata gerillor från både nord och sydstats sidorna osv. Det är Rangers förtjänst att Quantrills raiders (Sydstats gerilla) inte varit speciellt verksamma i området sedan kriget tog slut.\r\n', 'Quantrills raiders. \r\n\r\nLaglösa i allmänhet\r\nWolf Brothers i synnerhet.', '', '', 3, 4, 34, 1, 0, 'Minnekapi rangers är ett paramillitärt polisväsende som verkat runt om i delstaten sedan 1865. De har jurisdiktion att agera mot de som begår brott som riskerar stabiliteten i delstaten, till exempel tåg och dilligensrån, boskapstjuvar, renegata gerillor från både nord och sydstats sidorna osv. Det är Rangers förtjänst att Quantrills raiders (Sydstats gerilla) inte varit speciellt verksamma i området sedan kriget tog slut.\r\n'),
(9, 'Five Fingers', '\r\nFive Fingers har inte några direkta vänner som gäng, men de kan definitivt ha folk i spelvärlden som interagerat eller samarbetat med dem tidigare, både som gäng och som individer. Men gänget har för den sakens skull sin lojalitet till själva gruppen, så om en gammal kontakt skulle kontakta dem för hjälp är den hjälpen inte garanterad om det skulle riskera gängets säkerhet.\r\n\r\nFörmodade kontakter som gänget kan ha samarbetat med tidigare är:\r\nBankrånare, tjuvar, småtjuvar, pokerspelare, lurendrejare men även \"vanligt folk\" och människor i andra situationer - beroende på vilken typ av samarbete det rör sig om!\r\n\r\n', 'Five fingers är ett blandat gäng, både män, kvinnor, äldre och barn finns i dess skara. Gänget fungerar i grund och botten som en familj, de är varandra lojala och skyddar varandra i alla lägen. Många i gruppen ser säkert Five Fingers som en familj -snarare- än ett gäng, även om den uppfattningen sällan delas med folk som betraktar gruppen utifrån. De sysslar med allting från ficktjuveri, scams, personrån, utpressning, pokerturneringar till trevliga sällskapliga fester i sitt läger där byn är inbjudna till att delta. Gänget förhåller sig allt som oftast vänliga med besökare så länge besökaren i fråga är trevlig tillbaka (och inte är ett alldeles för uppenbart byte att lura). Om det kommer någon för att gräla så får de också gräl tillbaka.\r\n\r\nLojaliteten till gänget och Ram är för medlemmarna otvivelaktig både OFF och IN - detta är något vi kommit fram till eftersom vi inte är intresserade av spel på förräderi eller svek inom gruppen.\r\n', 'Five fingers har, liksom med vänner, inte några direkta fiender eller blodsfejder vad gällande gäng. Men flera i gänget (om inte hela gänget) har haft problem med Pinkertons agenter tidigare och gängets ledare är efterlyst, liksom många andra i gänget i varierande grad och summa. \r\n', 'Det kan ha ryktats om att gänget är mycket större än den lilla grupp som deltar på lajvet/befinner sig i Slow river. Gruppens ledare, Enoch \"Ram\" Ramsden är antagligen den medlem som är mest känd, och lär anses vara gruppens ansikte. \r\n\r\n(Ram är en NPC som inte kommer spelas på lajvet, anledningen är för att vi vill låta spelarna som deltar på lajvet kunna komma fram till vad de tycker behöver göras med lite större frihet, men med Rams tydliga principer som måttstock även om han är frånvarande)!\r\n', 'När det kommer till intriger som rör gruppen vill vi gärna att jag (Noah) får lov att agera kontakt/representant! ', 3, 8, 43, 1, 0, 'Five Fingers är vad många skulle kalla ett gäng (vilket för all del är sant), men är en resande grupp av folk av många slag och bakgrunder. Gänget spenderar det mesta av sin tid på andra platser än Slow River, men brukar vara inhyrda på Raspberry Hill när de är i byn (vilket råkar vara vid i princip alla lajvtillfällen)! '),
(10, 'Black raven ', 'gruppen är inte känd av folk i Slow river, om inte nån jobbar eller är jagad av gänget.', 'Gruppen är bara baserad på peaky blinder, inte familjen från serien alla i gruppen kommer ha olika karaktärer kanske nån släkt vem vet. PB var bara en term från 1880 talet på gäng från Birmingham, Gruppen är INTE familjen från serien. ', 'gruppen är ny i staden, inga direkta fiender ', 'Iden är att jaga nån som tagit pengar från gänget, och kanske kunna skapa en större scen då personen blir utdragen och \"avlivad\" kanske.  ', 'Gruppen är inte serien Peaky blinder, bara baserad men kläderna ska vara nära tv serien i still. ', 4, 7, 42, 1, 0, 'Gruppen är delar av ett gäng från Birmingham som hemma har kontroll över en del men andra vill ha makt med, alla har olika bakgrund.'),
(11, 'Reynolds farm', 'Borgmästaren, generalen', 'Bestod i Början av makarna reynolds som hankade sig fram med diverse olika affärsideer.\r\nNär vi fick igång ranchen och utökade med farm, skog och till slut en gruva och kvarn kom affärerna igång ordentligt.\r\nVi försöker ha bra affärsrelationer med så många som möjligt.', 'Tjuvar och banditer. Alla som försöker lura oss i affärer.', '', '', 4, 1, 38, 1, 0, '');

