INSERT INTO `regsys_house` (`Id`, `Name`, `NumberOfBeds`, `PositionInVillage`, `Description`, `ImageId`) VALUES
(1, 'Värdshuset', '3', 'Centralt i byn, vid vägen', 'En större sal med långbord och bänkar, bardisk för betalning/ servering och en eldstad som är godkänd för eldning. Det finns även en överbyggd veranda med fönsterluckor där det står långbord och bänkar. Sovplatser på loftet för kökspersonal. För serveringspersonalen finns det en gång och dörr till skafferiet och köksdelen på baksidan.', NULL),
(2, 'Grims hus', '2-3', 'Längst bort i byn på vänster sida. Efter värdshusets kök, nedanför Oktagonen.', 'Våningssäng med två bäddar, plats för fler sängar eller bord och stolar.', NULL),
(3, 'Galtåsen', '3 sängar + 5 golvplatser', 'I utkanten av byn, framför “kampringen”.', 'Stort tvåvåningshus med egen eldplats utanför. Två rum på ovanvåningen varav ett med 3 sängar och ett omöblerat. Balkong utanför sovrummet. Första våningen är samlingsrum med ett stort matbord. Utanför finns även ett bord med tak för servering, disk eller liknande.', NULL),
(4, 'Utsikten', '6', 'Längst in i byn längst åt höger med utsikt över dalen.', 'Ett ganska långt och högt hus. Ett stort bord med sittplatser som fungerar bra vid möten med mindre grupper, vid hantverk eller som matplats. Uppbyggd sovdel och loft där det också går att sova.', NULL),
(5, 'Insikten', '2-3', 'Längst in i byn på höger sida, i skogskanten', 'Byggår 2021, mindre hus som passar till exempel en familj med mindre barn.', NULL),
(6, 'Snokhuset', '4-6', 'Långt in i byn på höger sida, nära köket.', 'Enkelt boende i fasta sängar, bra för en grupp som spelar ihop.', NULL),
(7, 'Walbergastugan', 'Fyra, 120 cm breda, plats för 8 personer.', 'Mittemot värdshuset', 'Stort välbyggt boningshus något upphöjt från marken. Det är 24 kvadratmeter stort. Huset har två stora bord, bänkar, fasta förvaringskistor, hyllor, garderob, köksavdelning med diskbänk och diskbaljor, tre fönsterluckor och en mysig altan.\r\nSpisen är i nuläget tyvärr demonterad i väntan på nya brandsäkerhetsbestämmelser.', NULL),
(8, 'Bäckabo', '6-7', 'Huset ligger snett fram till vänster i förhållande till värdshuset.', 'Ett ganska stort hus. Stort utrymme för matbord och bänkar. Uteplats med tak på framsidan av huset med bord och bänkar.', NULL),
(9, 'Liljebacken', '2-5', 'Vid vägen, centralt i byn.', 'Liten stuga med flexibel inredning. Byggnadsår 2018.', NULL),
(10, 'Baggen', '2-5', 'Vid vägen, centralt i byn.', 'Liten stuga med två fasta 90 cm breda sängar i vinkel. Byggnadsår 2018. Låg tröskel med dörr mot vägen, gör det lätt att komma in. Fönsterlucka mot vägen går att fälla ner för ljusinsläpp eller som reception/ telegraf/ handel eller liknande.', NULL),
(11, 'Nolänga', '2-4', 'På höger sida en bit in i byn', 'Ett litet hus som ligger centralt i byn, vid vägen och nära värdshuset. Byggår 2018. Låg tröskel gör det lätt att komma in, stora fönster med luckor som går att öppna på båda långsidorna. Bord och bänk i stugan. Mysigt och ombonat. Två fasta sängar, över varandra.', NULL),
(12, 'Draknästet', '3-5', 'På höger sida en bit in i byn, bredvid stenröset.', 'Ett litet hus med ett rum, gott om plats, högt i tak och flexibelt eftersom det inte är så många möbler i huset.', NULL),
(13, 'Kottebo', '2-4', 'Till höger om vägen, nere i slänten.', 'Ett litet hus som det fungerar att sova, äta och bo i. Två fasta sängar, över varandra. En liten sittplats under tak på ena kortsidan.', NULL),
(14, 'Vindhem', '4-6', 'I skogsbrynet nära brunnen, till höger om vägen, nere i slänten.', 'Vindhem är ett renodlat boningshus. Det finns ett rum att umgås i och ett rum att sova i. Två fasta våningssängar.', NULL),
(15, 'Korpen', '3-5', 'Huset ligger ovanför brunnen, i skogsbrynet till höger om vägen. Till huset hör en fast eldplats på framsidan.', 'Byggt efter en modell som kallas båthus (takets utformning). Ett ganska stort hus med fasta sängar i två våningar.', NULL),
(16, 'Askebo', '0', 'Andra huset på höger sida efter vändplanen. Gården är granne till Langebro gård.', 'Avstängt för renovering', NULL),
(17, 'Langebro gård', '7-12', 'Gården ligger på höger sida efter vändplanen, har flera byggnader.', 'Langebro är en befäst försvarsanläggning med palissad och vakttorn. Gården består av flera byggnader: en lång isolerad tredelad huvudbyggnad, eldplats, fasta bord/bänkar under tak, eldgrop, matlagningshus, härbre på stolpar och jordkällare. Husen är av Nytegstyp i konstruktionen. I hagen utanför gården finns det även plats för ett större tält eller flera små. Gården passar därför bra som bas till en större grupp.', NULL),
(18, 'Drakahall', '10-15', 'Direkt till vänster uppe på en höjd när man kommer in i byn.', 'Ett 1100-tals hus i två våningar med balkong. Nedre våningen är matrum och förråd med långbord, bänkar och förvaringskistor. På övre plan är det ingen inredning men gott om plats för madrasser.', NULL),
(19, 'Valtorp', '6 st 120 cm sängar + golvyta', 'På vänster sida av vägen en bit in i byn.', 'Valtorp har två våningar. Det är inte ståhöjd på hela övervåningen. Det finns bord och bänkar men annars är huset tomt på saker.', NULL),
(20, 'Farevi', '2-3', 'På vänster sida av vägen, centralt i byn.', 'Liten, enkel stuga med lös inredning. Plats för några sängplatser och ett bord.', NULL),
(21, 'Skarven', '0', 'Mitt i byn.', 'Ett skrytbygge som inte går att bo i. ;).', NULL);

