--

CREATE TABLE `regsys_intriguetype` (
  `Id` int(11) NOT NULL,
  `Name` varchar(255) NOT NULL,
  `Description` text NOT NULL,
  `Active` tinyint(111) NOT NULL DEFAULT 1,
  `SortOrder` int(11) DEFAULT NULL,
  `CampaignId` int(11) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

--
-- Dumpning av Data i tabell `regsys_intriguetype`
--

INSERT INTO `regsys_intriguetype` (`Id`, `Name`, `Description`, `Active`, `SortOrder`, `CampaignId`) VALUES
(1, 'Lägerhäng', 'Det bästa på lajvet är att sitta och umgås med folk. Du kommer på något sätt att se till att det blir av. Troligen får du ingen skriven intrig kring det här, men det vore praktiskt att kopplas ihop med andra lägerhängare.', 1, 100, 1),
(2, 'Sociala tillställningar', 'Lite som lägerhäng, men mer för en utvald grupp. Kanske alla finare damer borde samlas? Eller vill du gå med i ett hemligt sällskap för personer med inflytande? Varför organiseras inga poesi-salonger i byn?', 1, 200, 1),
(3, 'Relationer', 'Din karaktär vill hitta en partner, har problem i sin nuvarande relation eller har en närstående som borde giftas bort. Vill den hitta en partner kan vi kanske hitta någon annan på lajvet att para ihop med. Eller vill du hellre para ihop andra?', 1, 300, 1),
(4, 'Misär', 'Du vill ha det svårt på lajvet. Bli sjuk, fattig och fråntagen allt du äger är inte uteslutet. Skilsmässa? Javisst! Karaktären tillhör säkert en utsatt grupp. Kanske har du gjort något dumt och har ångest för det.', 1, 400, 1),
(5, 'By-liv', 'Har något satt upp ett stängsel så dina kor inte når vattnet? Taggtråd, vem gillar taggtråd? Varför badar någon naken i indian-ån? Det är sällan lugn och ro mellan grannar.', 1, 500, 1),
(6, 'Handel', 'Alla som har angett rikedom 3 eller mer får i regel lite handel. Men väljer du aktivt den här typen av intrig (oavsett hur rik du är) innebär det att du för köpa och sälja saker och land inom lajvets system för handel. Det betyder alltsåu att du får mer intensiv handel än andra, men lyckas du kan du bli riktigt rik.', 1, 600, 1),
(7, 'Leta guld', 'Alla vet det finns guld runt Slow River. Du kommer att tillbringa en del av lajvet att gå runt i skogen runt området och leta efter guldklimpar inom lajvets system för inmitningar. Det kan bli blött och kan vara tråkigt om du inte hittar något guld. Men hittar du guld blir du säkert jätterik. Om ingen rånar dig.', 1, 700, 1),
(8, 'Poker', 'Slow River är känd för sina pokerturneringar och du vill delta i en eller flera. Blir det inget poker så kanske du själv startar en. Är du falskspelare? Är du en känd korthaj? Poker är inte ofarligt.', 1, 800, 1),
(9, 'Politik', 'Du vill bli vald till Borgmästare, domare, åklagare, skattmas eller någon annan post där man får bestämma och få betalt för det. Varför finns det inget statsråd i Slow River? Ska borgmästare styra eller vara en representant för rådet? Alternativt kan du ha en stark politisk åsikt och försöker omforma världen till den (ex anarkist, rojalist, populist, illuminist)', 1, 900, 1),
(10, 'Religion', 'Din karaktär är religiös och vill hitta fler personer med samma tro. Den vill också genomföra religiösa ceremonier. Är den i en religiös struktur så har överordnade säkert krav på karaktären också. Är karaktären en religiös ledare så kanske flocken inte alltid är så lätt att leda. Ska religiösa motståndare motarbetas?', 1, 1000, 1),
(11, 'Deckargåtor', 'Du är troligen inte kriminell. Ett brott, gärna ett mord, har begåtts. Av någon orsak vill du lösa det. Kanske bara för att du är olidligt nyfiken. Men se upp! Om brottslingen får reda på att du är den på spåren kanske du behöver tystas.', 1, 1100, 1),
(12, 'Kriminalitet', 'Din karaktär är kriminell. Den kan ha gjort kriminella handlingar som påverkar lajvet. Att göra brottsliga handlingar under lajvet är inte heller uteslutet. Var också beredd på att det kan innebära strid och vara farligt.', 1, 1200, 1),
(13, 'Ond bråd död', 'Din karaktär har begått ett mord eller dråp i det förflutna (som kan komma att uppdagas under lajvet) eller du kan tänka dig att begå ett liknande brott under lajvet som en del av din intrig.', 1, 1300, 1),
(14, 'Strid', 'Du vill skjuta med dina vapen och vill sättas i situationer där handgemäng, dueller och eldstrider är logiska lösningar. Självklart är du också beredd på att få byta karaktär under lajvet.', 1, 1400, 1);

