INSERT INTO `regsys_larpertype` (`Id`, `Name`, `Description`, `Active`, `SortOrder`, `CampaignId`) VALUES
(1, 'Myslajvare', 'Jag vill bara sitta vid elden och dricka te och småprata om minnen från förr. Jag får inga intriger och är inte inblandad i någon annans intriger. Myslajvare får heller ingen handel och blir troligen varken fattigare eller rikare under lajvet.(rekommenderas inte för nybörjare eller barn.)', 1, 100, 1),
(2, 'Passiv lajvare', 'Jag vill inte ha en viktig roll i lajvet. Jag åker mest för stämningen och för att interagera med min grupp eller övriga karaktärer. Jag vill inte ha några egna intriger mer än lite svaller om andra karaktärer som jag kan sprida.', 1, 200, 1),
(3, 'Karaktärslajvare', 'Min karaktär är allt. Jag har gärna intriger, men de får på intet sätt gå emot det jag skrivit om mig i min bakgrund.', 1, 300, 1),
(4, 'Aktiv lajvare', 'Jag älskar intriger, men jag älskar också min karaktär. Jag kan tänka mig att tumma lite på min karaktär om det innebär att jag får mer intriger.', 1, 400, 1),
(5, 'Action-lajvare', 'Jag vill gärna maxa min upplevelser på lajvet. Jag ser därför gärna att arrangörerna skriver en roll åt mig som passar den typer av intriger som jag gillar.', 1, 500, 1);

