INSERT INTO `regsys_role` (`Id`, `Name`, `IsNPC`, `Profession`, `Description`, `PreviousLarps`, `ReasonForBeingInSlowRiver`, `Religion`, `DarkSecret`, `DarkSecretIntrigueIdeas`, `IntrigueSuggestions`, `NotAcceptableIntrigues`, `OtherInformation`, `PersonId`, `GroupId`, `WealthId`, `PlaceOfResidenceId`, `Birthplace`, `CharactersWithRelations`, `CampaignId`, `ImageId`, `DescriptionForGroup`, `DescriptionForOthers`, `IsDead`) VALUES
(1, 'Declan Hart', 0, 'Fd pälsjägare, numera muskler hos mcdougals', 'Enstörig Trapper/tracker som vandra runt i vildmarken utan fast punkt eller mening i livet.\r\nlivnärt sej som bountyhunter och pälsjägare.\r\nförlorat fru o barn till Mässlingen.\r\nHård uppväxt till en misshandlande pastor till fosterfar.\r\nGjort affärer med Cormac och hans gäng då och då.\r\nnu funnit sin plats i Mcdougall familjen.\r\nlojal och lydig som en hund.\r\nhåller sej ofta för sej själv och smälter in i omgivningen vilket gör att han hör och ser\r\nmer än vad folk kanske tror.\r\nkvinnokarl(kommer bli mindre efter incidenten på jullajvet. se nedan)\r\n\r\nEfter ett \"snedsteg\" under julfirandet är Declan långt ner på hierakin stegen och kommer göra allt för att klättra upp och vinna tillbaka Cormacs gunst.\r\nHan våldförde sej på Fru Baxter som resulterade i misshandel från alla kvinnor i Mcdougals samt minne för livet i form av ett ärr i dom nedre regionerna.\r\nblev även piskad av Penny för han skvallrat runt i byn om att Borgmästaren minnsann tvättar hans underkläder.\r\n\r\n', 'Räddade Cormac Mcdougals från att bli skjuten under pokerturneringen i höstas.\r\nVåldförde sej på Fru Baxter under jullajvet\r\nDeltog i duel under jullajvet mot Fru Baxter och skadesköt henne i benet.\r\n ', 'Tillhör Mcdougals och ingår i familjen så bosatt sej i Slow River numera efter att ha bott bland indianer förr', 'Tillhör Crowindianerna och deras tro', 'Declan har haft en relation med Wolfbrothers ledare Black Betty när han var yngre. Nu när dom kommit till SlowRiver har Declan inte vågat berätta för Cormac o dom andra om sitt förflutna med Betty. kan ge lite \"kul\" spel som en insider spion för Mcdougals  samt Misär spel för mej :)   ', 'Kan bli intressant om min karaktär möter Black Betty och låtsas ge henne information men i själv verket e jag lojal mot Mcdougals.', 'Min karaktär fick en julklapp på jullajvet från Blue eyed Belle(Caroline Sjöwall NPCroll)\r\nhon kommer nog köra henne som att min karaktär och hon har ett barn ihop som min karaktär inte vet om och nu e hon i Slow River för att kräva underhåll\r\n\r\nduel spel om det ger folk i byn nåt e alltid roligt.\r\n\r\nmen jag e öppen för kul spel/ fysspel\r\nbolla gärna ideer med mej. brukar söka o planera in scener med andra på lajvet också så inget som måste komma från arr.', 'vill INTE att min karaktär ska dö', 'jag är öppen för allt spel och bolla gärna med mej om ni behöver nåt fysspel eller dyl', 2, 3, 2, 1, 'USA, Montana,Bozeman', 'Lumie hos Mcdougals. min karaktärs komplicerade kärleksaffär\r\nLydia Baxter, brevbärare, \r\nTerrible Terry hos Mcdougals, min karaktärs mentor i våldets ädla konst\r\n', 1, 2, '', '', 0),
(2, 'King Cooper', 0, 'Försäljare av hälsoprodukter', 'Strävar i livet att tillfredställa sina föräldrars krav på honom. SÖker ständigt sina föräldrars bekräftan. ', 'Jobbat för James osiris under vintern på saloonen. \r\n\r\nKysste Lumi på fyllan under julfirandet. \r\n\r\nBörjat skriva mer poesi och ofta folk frågar efter dem. ', 'Söker lyckan. Har lyckats ta ett lån och investera i ett hus (skarven). (vill inte ha deffinerat av vem eller vilka förhållande lånet innebär)', 'vardagstroende', ' Vissa av hans produkter innehåller ingridienser som kan vara tabuu. ', 'Gärna inte alls detta lajv', 'Löser intriger själv', '', '', 5, NULL, 2, 1, 'USA, Minnekapi, Junk City', 'Lumi - vän sedan tiden i New york - löser själv\r\nBullet Bil - vän sedan barnspel - det går bra för honom, men sämre för King Cooper\r\nCora - vän sedan barnspel - huserar King Cooper på sin gård - kanske fått problem pga det. ', 1, 13, 'Aldrig rädd för att sattsa på saker som ger snabba pengar och snab lycka. ', 'King Cooper är väldigt stolt över sina produkter och är en försäljare av rang. Gillar att skriva poesi, oftast av den snuskigare sorten. ', 0),
(3, 'William R. White', 0, 'Doktor / Entreprenör / Slaktare', '34 år gammal, född i Junction city med smeknamnet Doc\r\nSom person, stor bullrig, skrattar mycket och ofta, noggrann så det nästan är jobbigt, drar sig inte för att hugga i och bli \"skitig\".\r\nLeendet på hans läppar ligger där som en vänlig själ fram tills dolken sitter i ryggen och man funderar på hur detta gick till?\r\nUppvuxen i dammet till en guldsökande fader som knappt fick ihop till sitt brännvin och ännu mindre till föda.\r\nRappet av läderremmar är något han än idag ryggar ifrån då dessa ärr även om läkta känns än. Ramlade av en slump i händerna på en lokal läkare som snabbt fattade tycke för Williams starka kropp, åren gick där Will lärde sig det mesta tills han schabbla bort allt via alldeles för mycket alkohol och ett par dåligt valda ord plötsligt fann sig på flykt och därigenom fann sig plötsligt i McDougalls krets. Där han emot sina tjänster fann sin plats.\r\n\r\nUnder de senaste spelen och tiden som gått emellan har William fattat tycke för handel, nu ägare av en bomullsfarm en bit utanför Slow River och sina egna anställda som sköter plantagen i hans frånvaro. En genuint god individ som verkar inte ha ett ont ben i kroppen dock finns där många onda planer rullande bakom fasaden. Väldigt social och har lärt sig namnen på så gott som alla i staden för att kunna bjuda upp till trevliga konversationer och möjliga framtida affärer.', 'Skapat en ny bomullsfarm en dags ritt utanför Slow River med nyanställda.\r\nRäddade livet på Annabelle i five fingers.\r\nTog hand om den skottskadade brevbärarinnan Lydia Baxter.\r\nKnöt goda kontakter med Senator White (möjlig släkting?)\r\nBistod i affären av taggtrådsfabriken.\r\nKnivduell mot en familjemedel (Shotgun)\r\nRåkade få två personer beroende av kokain som nu gör allt han ber om.\r\nFick sina skelett i garderoben hanterade (begravda)\r\nFick dubbla priset på guld via Walkers trading station.\r\nSåg mer än han borde vid flera tillfällen.\r\nKnöt goda kontakter med Brigadgeneral Bailey.', 'Från början var det för att överleva, nu har han funnit sin plats och bor sedan något år tillbaka i Slow River.', 'Ortodoxa kyrkan', ' Han har mördat ett barn, en experimentell metod att bota astma hölls barnet bundet under vatten i fem minuter vilket skulle stoppa astman men tyvärr stoppade allt annat också. Senare skyllde han på att barnet dog av sina egna andningssvårigheter men han vet och fadern vet.....därför var han på flykt.\r\nHan är emotionellt bepansrad pga historia, att släppa någon in på livet är något han fruktar. Fruktar kärlek.   ', 'Exempelvis droppa informationen om att han har mördat barn till någon? Be någon göra närmande kärleksfullt mot honom? Öppen för allt.', '', 'Kör på allt', '', 6, 3, 3, 1, 'USA, Junction City', 'Oj vilka har jag inte relation med är nästan lättare.\r\nViktigast för denna karaktären är dock Cormac McDougal som han ser lite som en fadersfigur.\r\nBrigadgeneral Joseph Bailey - en spännande träff och likasinnade intressen drog ihop dessa två. Mycket prat om saknad militärutrustning samt vart existerande utrustning kan ta vägen. Ser fram emot vad vi kan hitta på ihop.\r\nMarc Flint \"County Sheriffen\" de har fått ett underligt band ihop, de behöver knappt prata men förstår varandra direkt. \r\nMadame Anna Belle Rose - diskuterade eventuella framtida affärsplaner ihop men inte förankrat.', 1, 10, 'William \"Doc\" en förrymd läkare med ett glatt humör. Ställer alltid upp och hugger i när det behövs, både emotionellt o fysiskt.\r\nTillverkar droger på sin bomullsfarm, har en tendens att finnas i händelsernas centrum varje gång nått händer.\r\nHar en tendens att se och höra saker som man inte tror att någon sett eller hört.', 'En genuint god man med ett glatt humör.\r\nRelativt enkla läkarkunskaper och verkar arbeta för allas bättre.\r\nOerhört social och alltid öppen för nya äventyr, stort cigarr intresse.\r\nLite väl svårt att hålla koll på sig själv när alkohol är inblandat därför drar han sig för att hänga på saloonen.', 0),
(4, 'Magnolia Malone', 0, 'Torpare. Före detta lärarinna. Kan än idag ge enskilda personer lektioner för att tjäna extra pengar.', 'Magnolia föddes 1838 på en gård utanför Junk City. Hon är yngst av fyra syskon och sin pappas ögonsten. Som sjuttonåring började hon undervisa och knappt fyllda 22 år skickades hon av överlärare Jacob Katz till Slow River för att starta upp en skola. Hon mötte en man, förlovade sig och han försvann. Kvar lämnade han spelskulder som gjorde att indrivare ofta gav sig på stackars Magnolia och hon undslapp med nöd och näppe hemskheter som kidnappning och tvångsgifte. Hon träffade Vince, blev förälskad, gifte sig och födde en dotter som inte överlevde förlossningen -en överväldigande sorg. Strax därefter försvann Vince och var borta i fem år. Under den tiden förlovade sig Magnolia, inte för att hon slutat älska Vince, utan för att hon med stor sorg gav upp hoppet om att han skulle komma tillbaka. Hennes nya fästman, som visade sig vara ett lögnaktigt fä, dog dock av en sjukdom och nu är hon lyckligt återförenad med sin man. Tro det eller ej, men Magnolia har haft ganska många friare och uppvaktare sen hon kom till Slow River. Det måste vara attraktivt med bildning. Under tiden Vince var borta passade hon även på att träffas av en förlupen kula. Hon överlevde (uppenbarligen) men minnet av den nästan outhärdliga smärtan sitter kvar.', 'Magnolia tvingades under hot dela ut kort under McDougalls pokerturnering förra hösten. Det var en mycket traumatisk upplevelse. En ren gisslansituation faktiskt! Efteråt fick hon en brosch som \"tack\". Denna vägrade hon dock envist ta emot. Detta föll inte i god jord och till slut drog två av dem in henne i hennes hus och bröt en tumme på henne. Chockad av smärtan och skrämd från vettet gick hon då med på att bära broschen -som hon sen blev rånad på! Så vann hon ju 40 dollar i en poesitävling, inte att förglömma. På julfesten gav hon McDougalls lite väl valda julklappar, som en lärobok i räkning till Penny, en trasig brosch till Cormac och en julstrumpa med en gillrad råttfälla i till Terry, som bröt hennes tumme. Apropå honom så bad han henne om ursäkt för tumbrytningen och bad att hon ska lära honom läsa. Hon var först motvillig, men hennes vilja att tro gott om alla gjorde att hon till sist gick med på det. ', 'Mitt hem är min borg. ', 'Protestant', ' Väldigt svårt. Alla är inte skenheliga fifflare. Hon blev nästan beroende av morfin när hon hade blivit skjuten. Det gjorde ont och det gjorde nästan mer ont att ta hand om skadan.', 'Vet inte. Tycker det känns krystat att tvinga fram en mörk hemlighet. Magnolia har varit med om mycket mörkt, men inget som är hemligt.', 'Det känns som jag redan har skrivit ganska mycket. Jag är öppen för det mesta utom det jag har skrivit att rollen inte skulle göra.', 'Hon skulle aldrig, aldrig vara otrogen mot sin man av egen fri vilja. Hon skulle inte heller döda eller skada någon med flit eller stjäla och svindla. Däremot får gärna andra utsätta henne för saker.', 'Hon tycker pistoler är läskiga. Det var otrevligt att bli skjuten.', 3, NULL, 2, 1, 'Junk City', 'Maken Vince Malone (har dock ingen aning om han kommer på lajvet eller inte), fadern Frank Dawson (Ej spelad karaktär. Står sin dotter mycket nära. Får gärna skicka brev eller telegram), Yaakov (Jacob) Katz (Ej heller spelad. Överlärare och mycket nära vän med Magnolias familj, som en andra far. En mycket lättsam och hygglig man, men lägger gärna näsan i blöt och har alltid mycket att säga (om ni tycker detta var för långt skulle ni höra honom prata). Får också gärna höra av sig.', 1, 8, '', 'Magnolia är 30 år gammal och var tidigare Slow Rivers lärarinna. Nu har hon och hennes make, Vince ett torp som de jobbar på att bygga ut till en gård. Då hinner ingen människa undervisa.\r\nGodhjärtad, troskyldig och flitig är hon och inte rädd för att ta i när det behövs. Dock mer fåfäng än hon vill erkänna och klär sig gärna fint när tillfälle ges. Hon kan även  bli ganska impulsiv när hon blir ar', 0),
(6, 'Cormac McDougall ', 0, 'Gängledare, hälare, hobby som läderhantverkare ', 'McDougalls - \r\nSkotsk immigrant, grundare av Familjen. \r\n\r\nWithout yer family, ye\'re nothin\'. \r\n\r\nDon\'t back doun, nev\'r let \'em see ye\'r fear.\r\n\r\nUppvuxen i en fiskeby i Argylle, Skottland. Vägrade följa i familjens fotspår. Såg nåt större för sig själv, någonting mer än att vada runt i fiskrens och laga nät. Under sin uppväxt var det tuffa förhållanden, en far med grov alkoholproblematik, alltid nära till nävarna mot fru och barn. \r\n\r\nSparade sakteliga ihop pengar men insåg att han var tvungen att stjäla kyrksilvret från lokala kyrkan för att någonsin få ihop pengar till båtresan. \r\n\r\nVäl i New Yorks hamn blev han bestulen, och såg vem som gjorde det. Han hamnade i handgemäng med tjuven och slog honom blodig. \r\n\r\nTräffade senare Penny, som i utbyte mot beskydd, visade honom hur man överlevde i storstaden. Hon påminde om hans syster, och sakta började en familjär känsla växa fram och han började kalla henne smeknamnet han alltid kallade sin syster; Wee radan, Little rat. \r\n\r\nUnder de första åren lärde han sig mycket kring att se skillnad på äkta och falska smycken, genom att hjälpa till med att sälja stöldgods, värdera pärlor, ädelmetaller och smycken etc. \r\nDet lärde han sig av \"Big Stan\", en ökänd hälare kring Five Points i New York. \r\n\r\nÅren gick och sakta växte saknaden i bröstet efter Gemenskapen, känslan av Familj, som är viktig i den skotska kulturen. \r\nUtan en familj, en släkt, är man ingenting. \r\n\r\nCormac är varmblodig, lätt till temperament, hyfsat varmhjärtad, utan att vara vek, relativt rättvis och hård. \r\nInga skrupler kring att plocka bort ruttna element, eller så, för att skydda De sina. \r\nAccepter folks olikheter, men är inte lika accepterande av Provokativ uppkäftighet, utan anser att folk måste styras rätt ibland, med en hård hand. Ett arv från sin far. \r\n\r\nLåter folk ha frihet, men under ansvar och egen risk. Anser att har man tabbat sig blir friheten mindre nästa gång, och vice-versa. Dvs, visar folk att de fixar saker får de större ansvar och frihet, är nån klantig, eller sätter de andra i klistret, fixar Cormac en \"barnvakt\" tills de visat att de lärt sig sin läxa. \r\nAtt uppvisa en stark och stabil front och aldrig sänka garden har blivit naturligt hos honom, mer på senare tid när han inte har Bella att luta sig mot. \r\n\r\nFormad av sin uppväxt och bitvis hårda livserfarenhet har han drag av toxisk maskulinitet, aggression och bit-ihop-mentalitet. \r\n\r\nHar en friends-with-benefit-relation med Mackie, och är väl hyfsad nöjd över den överenskommelsen. \r\n\r\nHans stolthet är Sadie, eller Sam som hon hellre vill kallas. I mycket påminner hon honom om hennes mor; egensinnigheten, viljan att bidra, men också den envisa och långsinta stoltheten. \r\n\r\nAtt hon vägrar bära klänning och mycket hellre klär sig som en pojk är inget Cormac bannar henne för. Och på senaste tiden har hon börjat styra och ställa bland de andra ynglingarna i gänget. Detta har lett till en dold stolthet hos Cormac. ', 'Har hänt en hel del. \r\n\r\nÄr McD på väg att bli mer rumsrena , eller är det en del av en långsiktig plan att försöka ha fingrar med överallt? ', 'Gänget mellanlandade för några år sen, och bekvämligheten har gjort att de stannat. Familjen driver en stor Ranch utanför byn, och har dessutom hus i byn, för att kunna roa sig, umgås och finnas lätt-tillgängliga. \r\nHåller de på att boa in sig helt? ', 'Kristen , skotsk kristendom. Common sense-teorin. ', ' Att han stal från kyrkan, som ung. Hans första steg in i kriminaliteten. Och att han var involverad i mordet på Fred Sullivan. \r\n\r\n  ', 'Mordet har ju utmynnat i massa spel, som nu börjar bli avklarat, men kyrkostölden finns ju kvar. Men Vi har massa spel redan, så...', 'Inte spel på illojalitet inom gruppen, gruppen har valt att ha Intern Lojalitet som bas för vårt spel (så kör vi på konflikter inom gruppen, som vi kalibrerar och styr). ', 'Undviker gärna ', 'Att jag kan tänka mig vara Hälare igen, om det behövs. \r\nAtt jag kan tänka mig vara Trygghetsvärd igen om det behövs. ', 8, 3, 5, 1, 'Skottland, Argylle, en fiskeby där. ', 'McDougalls\r\n\r\nFive Fingers \r\n\r\nSenatorerna', 1, 4, 'Bonus Pater Familias - \r\nCormac är varmblodig, lätt till temperament, hyfsat varmhjärtad, utan att vara vek, rättvis och hård. \r\nInga skrupler kring att plocka bort ruttna element, eller så, för att skydda De sina. \r\nAccepterar folks olikheter, men är inte lika accepterande av provokativ uppkäftighet, utan anser att folk måste styras rätt med en hård hand. Ett arv från sin far. \r\n\r\nLåter folk ha viss frihet, men under ansvar och egen risk. Anser att; har man tabbat sig blir friheten mindre nästa gång, och vice-versa. Dvs, visar folk att de fixar saker får de större ansvar och frihet, är nån klantig, eller sätter de andra i klistret, fixar Cormac en \"barnvakt\" tills de visat att de lärt sig sin läxa. \r\nAtt uppvisa en stark och stabil front och aldrig sänka garden har blivit naturligt hos honom. \r\n\r\n\r\nKräver full lojalitet. ', 'Bonus Pater Familias för familjen, klanen, gänget; McDougall. \r\nEn hård man, med få skrupler, men oftast med ett leende på läpparna. \r\n\r\nUppfattas som vänlig, trevlig och socialt kompetent, men med en mean streak i ögonen, och en stolthet. \r\n\r\nBe civil and friendly, and he\'ll treat you right. Try to double-cross him and you\'ll find out. ', 0),
(7, 'Cora Ward', 0, 'Småbonde, mångsysslare, opportunist, språkrör för Taggtrådsfronten', 'En av de antagligen mer synliga förespråkarna för taggtråd. Hon arbetar med sin gård (och kamel), samt att vara öppen för andra möjligheter till inkomst. Uppväxten i Junk City har gjort att hon inte är rädd för att ta i när så krävs - om det så är på åkern eller med nävarna.', 'Förra året var Cora ny i Slow River. Gjorde kanske inte direkt något minnesvärt, lärde mest att känna folk och att utveckla sin gård. Största personliga vinsten var löftet om en kamel från Frank Fierce, mot att hon röstade på honom i borgmästarvalet.', 'Har en gård i närheten av Slow River och ett hus hon delar med vänner. Verkar ha bestämt sig för att ge hålan en chans och att skapa sig ett bättre liv här - om det nu bara går att få rätt på vissa saker.', 'Generisk kristen', ' Är öppen för förslag. Rollen kan ha gjort någon form av affär som kanske varit på gränsen där motparten upplever sig lurad. Kan också vara något relaterat till senaste politiska utvecklingen med Taggtrådsfronten. ', 'Gärna ett förslag på motpart.', 'Jag tänkte fokusera mycket av mitt spel på att vara en motpart till McDougalls och att kunna driva Taggtrådsfronten som en del av detta och att vara beredd på att ta konsekvenser för det. Jag vill lägga konfliktspelet på en nivå där roller kan bli skadade, men ingen blir ospelbar (då det oftast dödar spelet mer än främjar).', 'Ska en del till för att svika dem hon anser är sina vänner.', 'Är öppen för spelönskemål från arrangörerna.', 7, 2, 3, 1, 'Junk City', 'King Cooper - barndomsvän som följde med från Junk City. \r\nBullet Bill - barndomsväng som följde med från Junk City.\r\nPenny/McDougalls - Cora ser Penny som en korrupt del av Slow River och menar att en annan borgmästare vore att föredra. Kommer stämma av konfliktspel med McDougalls, men tar gärna förslag.', 1, 12, 'Länge velat ha en kamel och när hon fick löfte om en i utbyte mot att rösta på Fierce var lyckan gjord. Har sysslat med en del saker i gråzonen för att överleva den fattiga uppväxten i Junk City, även om hon numera inte talar om den tiden så ofta. Har en tendens att kunna hamna i bråk om det handlar om sådant som känns viktigt för henne.', 'Pratar ofta om sin kamel. En högljudd förespråkare för taggtråd och det ryktas även om att hon var initiativtagare för Taggtrådsfronten, en sammanslutning som verkar för att åter tillåta taggtråd. Kommer från Junk City och verkar ha hankat sig fram på lite av varje, frågan är om allt var lagligt. Har sedan hon kom till Slow River hamnat i ett och annat slagsmål och verkar inte främmande för det.', 0),
(8, 'Tessie O\'Rourke', 0, 'Revisor', 'Tessie O\'Rourke/Treise Ní Ruairc är ursprungligen från Irland men immigrerade som liten till USA tillsammans med sin familj. Så Tessie växte upp på en gård där det var långt till närmsta granne men inte längre än att man ändå hörde ihop. Hon har alltid haft lätt för siffror och med många i syskonskaran i kombination med att Tessie aldrig varit vidare bra på att sköta en gård så var det bättre att hitta annan försörjning istället för att stanna hemmavid. Hon lärde sig därför revisorns yrke och har försörjts sig på det sedan dess. Tills en början så höll hon sig mest i sina hemtrakter men en anställning hos Reynards LLC förde henne allt längre hemifrån. Nu när hon åter är frilansare med sitt eget företag så har hon fortsatt att resa varhelst jobben tar henne även om hon föredrar att hålla sig till nordstaterna.\r\n\r\nSom person försöker Tessie alltid att ge ett vänligt och hjälpsamt intryck. Hon är mycket noga med att sära på yrkesliv och privatliv och har därmed väldigt olika åsikter beroende på om du frågar henne något i rollen som revisor eller om du bara frågar henne. T.ex har hon väldigt lite till övers för engelsmän men yttrar det inte högt om hon inte är säker på vem som hör för engelsmän är likväl fortfarande potentiella klienter. Den som ogillar Tessie kan säga att hennes sätt att sära på sina åsikter gör henne till en opålitlig hycklare men enligt Tessie så handlar det om yrkesheder. Anställer du henne som revisor så ska du inte behöva räkna med hennes privata angelägenheter och viseversa om du talar med henne privat.\r\n\r\nTessie ogillar översittare och har inte världens högsta åsikter om lag och ordning i allmänhet. Visst är det bra att det finns regler så att alla vet vad som gäller men vissa av dem är ju som gjorda för att tumma på. Så länge det inte märks att man är utanför dem så gör det väl inget? Lägg ett förslag fram på rätt sätt så kan Tessie gå med på det mesta. Gränsen går någonstans vid mord, kidnappning och tortyr.\r\n\r\n', 'Höstlajvet 2022\r\nAnlände till Slow River för första gången för att göra affärer åt sin arbetsgivare.\r\nBlev kort indragen i Walkers problem med bokföring. Blev ombedd att ta en titt på bokföringen som visade sig innefatta viss förskingring, blev hotad av han som skötte bokföringen för att inte säga något till Walker. Berättade ändå för Walker vad hon sett i bokföringen, oklart om det fick några konsekvenser i slutändan.\r\n\r\nBlev släpad inför sheriffen av en arg bonde som blivit utpressad/hotad av Reynards LLC. Lyckades snacka sig ur situation med en kombination av gaslighting och mutor. Beslutade sig därefter att ett jobb hos Reynards inte var bra för hälsan utan bestämde sig för att starta eget.\r\n\r\nVinterlajvet 2023\r\nÄgnade större delen av julen åt att skvallra med folk. Ropade på auktionen tillsammans med Hilda hem rätten att bestämma vem som Maggie skulle irritera. Valet föll på Orsini vilket i Tessie i efterhand insåg kanske inte var världens smartaste val. ', 'Affärer har åter fört Tessie till området och eftersom hon tycker om folket i Slow River så har hon beslutat sig för att stanna där några dagar för att träffa gamla bekanta och se om det finns något jobb.', 'Katolik', ' Att hennes förre arbetsgivare var Reynards LLC  är ju i sig ingen hemlighet. Men Tessie skulle föredra om det aldrig mer kom på tal exakt vad företaget sysslade med. Att hon vid enstaka tillfällen själv var med och drev in betalningar från de som företaget slagit sina klor i vill hon helst begrava djupt bland sina hemligheter och aldrig behöva tänka på igen. Hon är en ny Tessie nu, en snällare Tessie.  ', 'Det kan dyka upp saker från det förflutna som hindrar Tessie från att helt gå vidare i livet.', 'Jag föredrar om Tessies mörka hemlighet inte blir en allt för stor del av mitt spel.', 'Jag har inga planer på att ge mig in i farligt spel. Som tidigare nämnt så drar Tessie gränsen för vad hon går med på någonstans runt mord, kidnappning och tortyr.', '', 4, 7, 3, 8, 'Irland, County Leitrim', '', 1, NULL, 'Tessie är chefen och det gör ni bäst i att komma ihåg. Så om gruppen ska visa enad front kring något så är Tessies ord lag. Men så fort vi inte aktivt representerar företaget så kan man tjafsa hur mycket som helst med henne. Försök er aldrig på att övertala henne att det är en bra idé att spela om gruppens pengar eller att de ska investeras i högt flygande planer, det enda ni får ut ur det är en dumförklaring.', 'Tessie O\'Rourke, revisor, till er tjänst. Behövs det hjälp med något som är det minsta kopplat till siffror? Tessie löser allt, mot betalning såklart.\r\n\r\nPrivat så tycker Tessie om att utbyta historier, utbyta lite vänligt skvaller och att sjunga sånger. Hon är alltid villig att hjälpa den som ber henne och är allmänt vänlig och godhjärtad.', 0),
(9, 'Lumie', 0, 'Fotograf', 'Louisa \"Lumie\" Langdon är uppvuxen i New York, där hon som ung flicka träffade på James Orsini. När han lärde henne poker fick hon snart smeknamnet Lumie, då hon lyste upp när hon fick en bra hand. Lumie blev hans lilla projekt, och hon är formad med hans åsikter som grund. \r\n\r\nNär James hastigt försvann blev Lumie ensam när modern dog. Av en slump träffade hon fotografen Peter Hansen, som hon senare gifte sig med. Redan innan bröllopet började Peter att slå. Efter en extra våldsam kväll bestämde sig Lunie för att det var nog. Hos King Coopers affär köpte hon på sig en stor mängd kvicksilver som hon förgiftade sin man med, innan hon tog hans kamera, sina få tillhörigheter och försvann från New York. \r\n\r\nEfter nått år som runtdrivande träffade hon återigen på James Orsini. Nu som en del av McDougall-familjen. \r\nHon har varit med familjen i många år och drar in pengar som fotograf. \r\n\r\nHon hade en kort, intensiv relation med Marc Flint, men den blev tvungen att avslutas. Lojaliteten till James har ibland ställt till problem, både för Lumie och för James, då hon inte alltid satt familjen först.\r\nI vintras blev hon beordrad att tillsammans med ett par andra i familjen sondera terrängen i Mexico, I de fall som Wolf Brother\'s får för sig att ställa till problem i Slow River. \r\n\r\nLumie använder inte sitt gamla namn längre. Familjen vet om det, samt King Cooper, som kände henne under namnet Louisa Hansen när hon var gift, men rädslan för att Peter inte var död och skulle komma efter henne är stor. Det har också varit en stor ångest kopplad till namnet som brukade vara det sista hon hörde innan hon svimmade av Peters misshandel.\r\nSom en fin \"julklapp\" hade Lumie fått en ask med en flaska kvicksilver, samt en lapp där det stod \"Kära Louisa  det här är allt som behövs. God jul. Din Peter\". ', 'Lumie sjunger gärna och spelar också trumma och nyckelharpa. I somras och höstas var det dock lite problem, då hon under våren hade en \"olycka\" som resulterade i tre brutna fingrar. ', 'Lumie bor i Slow River med resten av McDougall. Hon har under de senaste månaderna varit på resande fot till Mexico.', 'Protestant.', 'Lumie har försökt döda sin man, som under vintern gett sig till känna och nu verkar veta vad hon finns. Eller så är det nån som känner till hennes mordförsök.\r\n\r\nLumie är obrotsligt lojal mot James Orsini.\r\n\r\nLumie har konflikterna känslor, både gentemot Damien i Five Fingers, men också mot King Cooper. ', 'Lojalitet mot James är viktig. ', '', 'Förräderi mot McDougall', '', 11, 3, 3, 1, 'Uppvuxen i New York', 'James Orsini.\r\nCormac McDougall\r\nDamien från Five Fingers. \r\nKing Cooper', 1, 9, '', 'Lumie är en bra fotograf och mycket lojal till McDougall-familjen, och främst James Orsini. Hon är också en bra pokerspelare.\r\n\r\nHon har setts ha ett nära förhållande till Damien i Five Fingers, vilket nog förvånat många. \r\n\r\nLumie har svårt att hantera för mycket sprit, vilket resulterat i att hon ibland tagit dåliga beslut när hon druckit mer än hon tänkt.\r\n\r\nHon sjunger och spelar gärna trumma', 0),
(10, 'James Orsini ', 0, 'Sågverksmagnat', 'Han sköt tomten, som han nu misstänker är Walkers försvunna storebror\r\n\r\nJames vill starta en orden för de rika i byn, the order of the Racoon, officiellt för samhällsförbättring och filantropi, innoficiellt för att de rika ska umgås och kunna göra bättre affärer med varandra.\r\n\r\nPå Jul-lajvet kom ett telegram om att halsbandet som James gav bort till annabelle tillhörde James döda mor. Det satte igång en händelsekedja där James ordnade en förfalskad order till sheriffen om husrannsakan på raspberry hill.\r\nDen falska ordern kom från \"Pinkertonagenten John Mitchum\", men John Mitchum (npc)är egentligen en prisjägare som jagar James vän Bart Callum (jobbade i köket på Jul-lajvet)\r\nHusrannsakan blev helt onödig för Sam Macdougall hade redan stulit tillbaks halsbandet.\r\n\r\nPå julmiddagen berättade James för gästerna om the Order of the Racoon och jobbade hårt på att bli vän med änkan Rose och brigadgeneralen och få med dem i sin orden.\r\nJames och Cormac hade ett möte om hur saker och ting bör gå till i Slow River och blev osams, då James vill göra affärer mer lagliga och armbåga sig upp i samhällets toppskikt.\r\nJames drev under jul-lajvet Dirty Dicks och har en vadslagning med Charlotte. Ifall hon finner sin bror så är James skyldig henne fyra lass med ved och virke, om hon misslyckas så vinner James några procent(minns ej hur många) av ägandet i Saloonen.\r\nJames, som egentligen är homosexuell, har föreslagit ett bekvämlighets-giftermål till Ellie i Macdougalls för att få mer respekt i byn som en kristelig och gudsfruktig ordningsam herre (vilket han ju inte alls är)\r\nDet kommer vi ha spel på inom vår grupp.\r\n\r\nJames är väldigt irriterad på county sheriff Marc Flint och hans förmåga att tala för mycket,men inser att det är viktigt för OFW Sawmill Inc att ha kvar sheriffen som delägare. Han har dock satt ned foten mot Lumie om att hon umgåtts med Flint då han inte litar på Flint till fullo. \r\n\r\nJames stora fokus är att bygga upp företaget och att vinna respekt i byn och att höja sin sociala status.\r\nHan är en rovkapitalist och sociopat.', 'James gjorde många goda affärer förra lajvet men har en stress kring Walkers trading post då han insett att tomten han sköt förmodligen är den saknade storebröder Walker.\r\nDen ende som vet detta är den gamle telegrafisten, som även skickade mördare att försöka skjuta James. Så James vill få tag i telegrafisten och sätta dit honom för mordet på Walker.\r\n\r\nJag tror jag hade allt för att höja upp företaget ett hack under förra lajvet. Fick ju en sten i skallen så sista dagen är lite diffus. Kryssade iaf in karaktären som jätterik för det borde han väl vara om stan byggs ut och han sitter på all planktillverkning, men det där har ni bäst koll på. Han kanske bara är rik.', 'Bor nära byn och har ekonomiska intressen. Reser dock mycket i affärer, till Junk City. ', 'Protestant', ' Mordförsöket förra lajvet har gjort Orsini väldigt stressad, då han inte förutsåg det. Han har börjat tvivla på sig själv och detta har lett till att han missbrukar tabletter som han får från Doc. Han får abstinens och är mer oberäknelig, även för sig själv.   ', 'Det kommer leda till en splittring mellan James och Cormac. Och att Doc kan styra James beslut. Nån kan veta om detta och försöka utpressa James.', 'Det vore kul om NPCn prisjägaren Jahn Mitchum dök upp och letade efter James vän Bart Callum, särskilt som James använt hans namn i den förfalskade ordern från pinkertons.\r\nSpelar gärna vidare på telegrafistintrigen ifall Walkers kommer.\r\nI övrigt så har vi mycket intriger från innan inom gruppen och gentemot five fingers som vi kommer spela vidare på.', 'Undviker gärna vassa stenar det här lajvet 😅', 'Jag spelar gärna den onde protagonisten i andras intriger. Tycker det är kul att vara den som folk älskar att hata.', 18, 3, 5, 1, 'Frankrike ', 'Cormac Macdougall\r\nLumie\r\nCharles Herrington (NPC)\r\n\r\nVi har spel inom gruppen.\r\nJames kan gå hur långt som helst för att skydda Lumie från hot utifrån, men är ganska svinig mot henne. Ser henne som en lillasyster/dotter\r\n\r\nCharles är James barndomskärlek\r\n\r\nCormac är ledaren för Macdougalls, de är just nu väldigt osams kring hur saker bör gå till.', 1, 1, 'You guys know me :)\r\nFyller i mer här senare.', 'James Orsini äger och driver företaget OFW Sawmill Inc tillsammans med County sheriff Marc Flint, som driver sågverken i trakterna kring Slow River. Han har en svaghet för alla typer av spel och vadslagningar, men främst poker.\r\nEnligt vissa en väldigt ond och farlig man, enligt andra en stor välgörare för byn.\r\nHan bekostade byns senaste Julfest men sägs ha skjutit tomten en gång i tiden.\r\n\r\n', 0),
(11, '“Mackie', 0, 'Hembränning, hustler, hemmafru', 'Som yngsta dotter av fem syskon, två bröder och två systrar, förväntades Makenna att förbli ogift och ta hand om sina föräldrar under livets höst samt assistera i deras verksamhet, den lokala “Generall Store”. Därför var det en självklarhet att Makenna fick lära sig läsa och räkna. \r\n\r\nMekenna själv var dock inte så såld på denna tanke och det krävdes inte mycket uppvaktning från Fred Sullivan innan hon en mörk natt klättrade ut genom ett fönster och försvann i solnedgången med honom. \r\n\r\nÄven om de skvallrades en del bland grannarna när Makenne hade rymt var det lätt för måga att se hur det måste ha känt som en lätt väg bort från krävande föräldrar, aga, bibelläsning, plikt, långa arbetsdagar, kyrkan varje morgon. Och då var det bara det man kunde se från utsidan av familjen. Det var ingen romantisk illusion från hennes sida, men ingen sextionåring kan någonsin ha en aning om hur livet på prärien tillsammans med ett band banditer skulle se ut. \r\n\r\nHon skulle inte säga att hon klev ur askan i elden. Men många andra skulle säga att det var så. Skillnaden var att det ena helvetet var av is, medan det andra var hett. Och om hon var tvungen att välja så valde hon det helvetet där hon kände sig levande.\r\n\r\nFred och hans män var precis som alla andra råskin, men det fanns från början en genuin omtänksamhet om den unga kvinnan. Men med sämre tider kom sämre tålamod, och Freds drickande hade tillslut inga gränser. Och antalet gånger han misshandlat henne kunde ingen längre räkna. Så när Fred föll för en förlupen kula, fanns det bara ett svar på frågan som Cormac och Penny ställde. Självklart ville hon rida vidare med dem, mot något mer, mot en familj.', '', 'Delvis bofast', 'Kristen', 'Finns få utkritade idag, den enda stora kom fram för ett par lajv sedan. Mackie kan inte få barn och detta är pga att hon gick till en kvacksalvare när hon var gravid vid fel tillfälle. Men kan nog komma på en bunt om det behövs. Och är mottaglig för förslag!', 'Rykten eller hands on, im game', '', '', '', 20, 3, 3, 4, 'USA, Kansas, Salina', 'Alla inom McDougall och de flesta i Five Fingers - Allt som händer i McD påverkar Mackie. När det kommer till FF finns det öppningar för det mesta utom att hon skulle vara förälskad i någon. Från hennes bakgrund finns föräldrar, fd flammor, kvinnor hon suttit på kvinnohuset eller häktet med osv \r\n\r\n\r\n', 1, NULL, '', '', 0),
(12, 'Sam (Sadie) Mcdougal', 0, 'Ficktjuv, tjuvlyssnare, guldletare och redo att springa ärenden, om betalning finns ', 'What\'s in it for me? \r\n\r\nÄndå sen kroppen började förändra sig har Sadie blivit irriterad. \r\nOch för sig självt lovat dyrt och heligt att aldrig nånsin bli nåns lydiga och dygdiga hemmafru, uppassare eller slagpåse. För det har hon sett, hur vissa kvinnor bara tar emot och inte står upp för sig. \r\nOch den vägen kommer hon aldrig ta. \r\n\r\nNä, familjen har fått börja kalla henne Sam istället, det är ett bra namn. \r\n\r\nAtt växa upp längst vägarna, i diverse läger och alltid på resande fot har gjort sitt. Att få se blod, skador och död hela livet gör sitt med en ung människa. \r\nDjupt i bröstet finns en sorg, en saknad, men hon biter ihop. Men i musiken , där kan man få ett utlopp. Så när den där handelsresande i ett obevakat ögonblick blev distraherad av de andra ungarna i gänget stal hon en gitarr.\r\n', 'Lurade till sig ca 100 dollar ungefär från James Orsini. \r\n', 'För att familjen bosatt sig på ranchen utanför Slow River. ', 'Inte särskilt troende, men kristen, för ', ' Att hon saknar sin mor enormt, och att hon måste sova bredvid sin far var natt, för mörkret och tomheten på natten skrämmer henne. \r\nRädd för att stå i centrum, men det skulle hon aldrig erkänna. \r\n ', 'Det behövs inte. ', 'Inte spel på illojalitet. \r\nGärna spel på rykten, saker min karaktär kan ha hört när hon tjuvlyssnat, läst nåns telegram, dagbok eller så. ', 'Inte stå i centrum, som stort publikt spel. Vill inte få karaktären dödad. ', 'Npf-diagnoser, som ADHD, autism samt diagnostiserad Ångest. Men det har ni redan fått info om, om ni undrar, prata med pappa Kim. ', 21, 3, 4, 1, 'New Orleans , USA ', 'McDougalls\r\n\r\nFru Malone \r\n\r\nBrevbärare/telegrafister etc - för ärenden och dylikt. ', 1, 3, 'Att hen är arvtagaren, en jäkel på att tjuvlyssna i lönndom och alltid redo att viska i Cormacs eller Mackie\'s öron...', 'Cormac McDougalls unge, en ty