(13, 'Benjamin Fletcher', 0, 'Lantmätare (Mätmästare)', '[Placeholder. Skall uppdateras]\r\nGrundare, mätmästare, krigsveteran', '[Placeholder. Ska skriva in en sammanfattning av förrförra lajvet]\r\nBenjamin var ej i Slow River förra året. Han var ute och mätte på annan ort. ', '[Placeholder, skall specificeras]\r\nKartering! Och eventuell mark vi fortfarande äger i området behöver hanteras... ', 'Kristen, protestant [om det inte ställer till problem för er att jag ändrar Bens bakgrund från katolik till protestant]', '[Kan komma att fyllas ut]\r\nLaudanum-beroende (smärtstillande opiumpreparat) på grund av trauma från krigsåren. ', 'Någon som har laudanum kanske vill ha en tjänst av företaget i utbyte mot det - exempelvis fifflande med markrättigheter, kartgränser eller intyg. ', 'Satsar gärna på intriger kopplade till gruppkonceptet och företaget (men annat är också välkommet). ', '', '', 19, NULL, 4, 6, 'USA, New York, New York', 'De andra i gruppen, sin exfru Edna (bakgrundskaraktär) och Arlingtons bror (också bakgrundskaraktär). ', 1, NULL, 'Grundare, mätmästare, krigsveteran, verkar rätt glad i laudanum (opium-baserat smärtsillande). ', '[Kan komma att utvecklas]\r\nEn av grundarna för A&F Land survey Co. Mätmästare. Krigsveteran.', 0),
(14, 'Fru Fiona B Cecil', 0, 'Lantmätare ', 'Sist blev hon rånad tre gånger och insåg att hon är alldeles för blåögd. Men hon vill ändå tro på lag och ordning och Amerikanska staten.\r\nHon är inte lantmätare, har ingen examen. Det är en öm punkt och hon vill bevisa att hon kan. Att få skicka en valdestriktskarta till delstatskongressen var en milstolpe hon är stolt över. Men var kartan verkligen korrekt? \r\nFd maken (oklart om skilsmässan är officiell?) är däremot utbildad och förmodligen också en tidigare vapenbroder till Arlington och Fletcher. Han kom hem nedbruten av kriget och då drev Fiona firman ett tag. Hon vet inte vad som hände i kriget, bara att han blev en spillra av sitt tidigare jag. Till slut ledsnade hon, han är ingen man längre.. \r\n', 'Hon som höll i befolkningsräkning/vallängd vid förra valet. Blev angiven för sheriffen i slutet av förra lajvet av prisjägare, men det verkar vara uppklarat. Förlorade alla sina pengar till rånare och mutor till Sheriffen. Fröken Ade Monaghan känner till att Fiona är anklagad för stöld av instrument, men blev av någon anledning övertalad att det var en orättvis anklagelse. (lite oklart varför, det var fem minuter innan lajvet var slut)\r\nFiona bröt ihop efter sist rånet över att hon inte var kapabel att försvara sig. Hon är nu fast besluten om att faktiskt lära sig det, och har skaffat en läskig revolver. Men hon vill verkligen inte skada en oskyldig.. ', 'Jobbar för AF Survey co', '', ' Det där att hon inte har en examen och nog faktiskt innerst inne vet att hon stal instrumenten. Hon ska betala dem, så fort hon får ihop lite pengar..  ', 'Låt Herr Charles kontakta Arlington och Fletcher.. ', 'Hon vill vara en fin dam, men hon är också rejält blåögd. Hon behöver pengar.. Kan hon tjäna en hacka och det verkar vara rätt och riktigt kan hon nog övertalas att göra någon en tjänst. ', 'Skjuta utan att bli provocerad. ', '', 27, NULL, 2, 4, 'USA, Ohio, Cambridge ', 'Gabriella Cecil, förlupen syster (guldgrävare)\r\nWilliam Charles (minns inte exakt namn) tidigare make, oklart om skilsmässan gått igenom\r\n', 1, 14, 'Hon är lantmätare och inte rädd för att hugga i. Bra på att räkna och rita. Inte bra på att försvara sig. (blev rånad tre gånger sist i Slow River) Är kanske lite naiv och oerfaren av de mer praktiska delarna av fältarbete, fortfarande ett ömskin. Behöver lära sig skjuta och slå i gränsmarkeringar ordentligt. ', 'Hon som höll i befolkningsräkning/vallängd vid förra valet. Gillar mode och fina kläder men har inte råd. Blev angiven för sheriffen i slutet av förra lajvet av prisjägare, men det verkar vara uppklarat. ', 0),
(15, 'William Poole', 0, 'Gambler/entreprenör', 'Kommer från en relativt bildad bakgrund. Har arbetat som agent för både saloonägare samt diligenser och kan ta vara på sig själv. Spelar gärna poker.', 'Nej.', 'I första hand på genomresa men är samtidigt opportunist och kan tänka sig att dröja sig kvar om det finns goda skäl.', 'Protestant.', 'Har övergett sin familj i New York och rest västerut för egen vinnings skull. ', 'Telegram?', 'Nej, det mesta är nog ok.', 'Sexuellt våld.', 'Nej.', 26, 6, 3, 3, 'USA, New York State, New York', 'Gruppen är tillrest och har inte hunnit etablera några djupare relationer i Slow River. Ser väl gärna framtida samröre med movers and shakers så som sheriffen eller dylikt.', 1, NULL, 'Kommer från en relativt bildad bakgrund. Har arbetat som agent för både saloonägare samt diligenser och kan ta vara på sig själv. Spelar gärna poker.', 'William Poole är relativt nytillrest i Slow River och har inte hunnit gjort sig känd. Förefaller vara en relativt välbeställd entreprenör från Yankton. ', 0),
