(17, 'Gabe Cecil', 0, 'Guldgrävare ', 'Guldgrävare, tidigare i Sacramento California. För mycket konkurrens där nu. Blev avlurad sin inmutning. Vill starta om. ', '', 'Vill skaffa en ny inmutning ', '', ' Rymde hemifrån för att gräva guld och bli rik. Utger sig för att vara man. Det är enklast så. ', 'Vill inte hittas av sin familj. Hon tror inte att de accepterar henne. ', '', '', '', 27, NULL, 1, 6, 'USA, Ohio, Cambridge ', 'Fiona Cecil, syster\r\n?, lurendrejaren som fick Gabe spela bort sin inmutning i Californien', 1, NULL, '', '', 0),
