(19, 'Loyd Poole', 0, 'Gambler/Profitmaker', 'Knivhögg en falskspelare i Denver innan ankomsten till Slow River. Oklart om personen överlevde. \r\n', '', ' Spela och tjäna en hacka pengar. ', 'Protestant', ' Älskar Botanik mer än allt annat i världen. Döljer detta kraftigt för alla, men speciellt för sin bror. Har en egen liten bok där han samlar på blommor. Försöker i smyg få reda på de latinska namnen på blommorna.  ', 'Botanik intresset skulle skada Loyds ryckte som den hårdaste av Yankton\'s Finest.', 'Inget kärleksintrig\r\n\r\nKan få spinna vidare på knivandet av falskspelaren i Denver.', 'Kärleksintriger', '', 17, 6, 3, 6, 'America, South Dakota, Yankton', '• William Poole - Familymember (Brother)\r\n', 1, 5, 'Yanktons Finest vet nästan allt om Loyd. Han är musklerna åt sin bror William och backar inte för att sin brors parti när det kommer till konflikter eller beslut. ', 'The muscle in Yanktons Finest. Heavy drinker and a grumpy attitude. ', 0),
