(24, 'Hilda Johansdotter', 0, 'Revisorassistent', 'Hilda är gruppens allt till allo och arbetar tillsammans med Revisor och Co. Hon är för det mesta positiv, trevlig och tänker inte alltid efter. Hon har en tendens att skapa problem för sig själv och det händer att hennes kollega Tessie O\'Rourke får komma till undsättning med mutor till rätt personer eller betala skadan hon orsakat. Hon agerar oftast utifrån egna intressen och kan vara självisk, även om hon bryr sig om de egna kollegorna. Hon gör dock sitt bästa och trivs bra med sin anställning och livet i allmänhet. ', '- Förnekat diverse brott (som hon absolut hade begått) och tog sig ur nämnda situationer med mutor. Det gick bra för Hilda, även om hon blev ganska mycket fattigare.\r\n- Handlat med diverse varor.\r\n', 'Hilda äger ett litet torp utanför Slow River och är tillbaka i området för att kolla till det. Sedan har företaget arbete i Slow River och det vore ju synd att gå miste om en chans att tjäna pengar. ', 'Katoliker. ', 'Hilda hittade ett fint smycke och plockade på sig det utan att fråga. Hon insåg för sent att det var ett väldigt dyrt smycke från en väldigt viktig person. Sedan blev det en ganska stor grej så nu vågar hon inte riktigt sälja det heller. Hon håller tillsvidare tyst om det, åtminstone tills hon reser iväg och kan bli av med den.  ', 'Någon vill ha tillbaka smycket. Kan också vara ett annat viktigt föremål om det passar bättre in i en intrig. ', '- Saker att handla med.\r\n- Hon har säkert förargat någon. \r\n- Ligger troligtvis i skult till någon. ', '', '', 28, 7, 3, 1, 'Sverige, Kalmar', 'Tessie O\'Rourke - Kollega och gemensamt företag sedan ett år tillbaka. De hoppade båda två av företaget Reynards LLC efter att chefen kommit med ett antal dumma riskfyllda idéer med dåliga konsekvenser. \r\n(Inga andra specifika karaktärer, känn er fria att lägga till personer/släkt/vänner i hennes bakgrund ifall det behövs för en intrig)', 1, NULL, 'Hilda är gruppens allt till allo. Hon är för det mesta positiv, trevlig och tänker inte alltid efter. Hon har en tendens att skapa problem för sig själv och det händer att hennes kollega Tessie O\'Rourke får komma till undsättning med mutor till rätt personer eller betala skadan hon orsakat. Hon gör dock sitt bästa och trivs bra med sin anställning och livet i allmänhet. ', 'Hilda är gruppens allt till allo. Hon har en känsla för ekonomi och handel. Hon är för det mesta positiv, trevlig och tänker inte alltid efter. Hon har en tendens att skapa problem för sig själv. Hon gör dock sitt bästa och trivs bra med sin anställning och livet i allmänhet. ', 0),
(25, 'Ingrid Svensson', 0, 'Piga', 'Arbetar på Hilda Johansdotters gård. Spenderar det mesta av tiden på gården men har åkt in till Slow River en sväng nu när hon ändå har en ledig dag. ', 'Nej. ', 'Ingrid har en ledig dag och har bestämt sig för att åka in till Slow River och se vad folk håller på med. ', 'Katolik', ' Stjäl ibland från gården hon arbetar på. ', '(Endast extra karaktär så behövs inte mycket intrig här)', '', '', '', 28, NULL, 2, 1, 'Slow River', '', 1, NULL, 'Ingen grupp', 'Bonde/piga. Allmänt trevlig och nyfiken. Gör sällan något väsen av sig. ', 0),
(26, 'Temperance Harris', 0, 'Bondmora', 'Temperance är från trakten och har aldrig varit särskilt långt bort från Slow River. Hon sköter sin gård tillsammans med sin bror och svägerska. Lugn och sansad dam.', '', 'Utflykt över dagen för att handla på marknaden', 'Katolik', ' Tycker att hennes bror är en inkompetent idiot.', 'Ingen aning. Om det skett så pass mycket under lajvet att den här karaktären hamnar i spel så vill jag mest ta det lungt resten av lajvet.', '', '', '', 4, NULL, 2, 1, 'USA, Minnekapi, Slow River', '', 1, NULL, '', '', 0);
