(27, 'Ellie Lewis', 0, 'Bedragare', 'Ellie är född i Denver och uppväxt på barnhem där. Föräldrar okända men troligtvis var modern prostituerad. Fram tills hon var 11-12 bodde hon på en väl skött inrättning där de gjorde vad de kunde för barnen, men barnhemmet brann ner och barnen placerades ut på andra ställen. Hon hamnade på Flitiga Fingrar som var raka motsatsen, varnvård och övergrepp var vardag. \r\nDär mötte hon Terry Bell och tillsammans lyckades de rymma. En period levde de på gatan innan de i en tågolycka kom ifrån varandra, båda övertygade om att den andra dött.\r\nEfter det blev hon kvar på gatan, hon lurade folk att stanna upp med historier om bortsprungna småsyskon och annat tårdrypande medan mer fingerfärdiga kamrater länsade fickorna på offren. Efter några år plockades hon upp av ett par bedragare som började använda henne som marionet, de lärde henne vad hon skulle säga och göra och det hennes skådespeleri inbringade i gåvor, mutor o.dyl från rika män delade de tre på. I 20 års åldern tröttnade hon på att vara deras verktyg och efter det har hon fortsatt på samma spår genom att bedra naiva män som har mer pengar än de behöver. \r\nFör några år sedan gömde hon sig på en skum saloon efter att hennes lögner uppdagats och hon misshandlats svårt. Där träffade hon Terry igen och han tog med henne till outlaw-gruppen McDougalls där hon levt sen dess.\r\nDet har inte varit lätt att anpassa sig till att leva i och anpassa sig till ett kollektiv men successivt har hon fallit in i rollen. Det här är hennes familj och hon skulle döda för dem. I smyg skattar hon ändå Terry och hans barn högre, de kommer gå före övriga familjen i alla lägen.', 'Hösten 2022: Ellie fick fingrarna brutna av den egna gruppen efter att hon klantat till det och handlat utan gruppens medgivande.\r\n\r\nFebruari 2023: Ellie gick med på att gifta sig med James Orsini för att spinna igång ett bedrägeri. När den planen väl var satt i rullning gav Terry henne tidernas kärleksförklaring och triggade de känslor hon själv haft men aktivt förträngt. Nu måste hon försöka reda ut om hon vill offra den kärleken för Orsinis räkning och hur hon annars ska lyckas ta sig ur överenskommelsen.', 'För att McDougalls är här, det är den enda anledningen.', 'Som uppväxt på katolskt barnhem så är hon i grunden katolik.', ' Ellie gjorde sina tidigare bedrägerier för att överleva, det hon aldrig berättar är att hon njöt av det och adrenalinkicken det gav att alltid vara en felsägning ifrån att bli upptäckt.', 'Jag har tyvärr inga förslag.', '', '', '', 12, 3, 2, 1, 'Denver', 'Terry, Jesse och Max Bell. Människor hon skulle offra allt eller åtminstone det mesta för. Det finns redan en hel del intriger runt dem så jag tror inte ni behöver slänga in mer där.', 1, NULL, 'Ellie är Ellie, varken mer eller mindre. Tjurigt lagd och med en förmåga att handla innan hon tänker vilket lett till problem inom gruppen mer än en gång.', 'Ellie, den allmänt tjuriga och tillbakadragna kvinnan som hänger med McDougalls. De som har försökt har insett att hon inte har något intresse av att prata om sitt liv och det är också tydligt att hon är obrottsligt lojal med gruppen.', 0),
(28, 'Clemens Tanner', 0, 'Sheriff i Slow River', 'Clarence \"Tenner\" Tanner\r\nClemens “Tenner” Tanner\r\n\r\nFödd i Arkansas Post, Arkansas territoriet 14 april 1819\r\n\r\n1828, vid 9 års ålder dör föräldrarna i en brand i hemmet. Tenner blir omhändertagen av grannar men 1831 slår ekonomisk olycka till och Tenner blir såld till annan familj för att jobba. Ett år senare rymmer Tenner efter att han har dödat en 15 årig person i ett knivslagsmål.\r\n\r\n1833 anländer Tenner i Helena, Arkansas. Han börjar spela men har inte mycket tur. Han försörjer sig bl a som hamnsjåare och saloonvakt men blir också, under två veckor 1835, deputerad av sheriffen när laglösheten är som högst i Helena. 1837 är olyckan framme och Tenner hamnar i skottlossning. Han skjuter två personer i en duell som urartar. Tenner får ett skott i sidan men blir inte så illa skadad. Under sin konvalescens vårdas han av sheriffens familj men ont blod har väckts då släkt och vänner till dem han har dödat ropar efter hämnd. Han får rådet att lämna staden.\r\n\r\nTenner hamnar i Memphis, Tennessee. Småjobb och småstölder avlöser varandra. En av hans få stora pokervinster någonsin mynnar ut i en vecka på Gayoso House Hotel innan pengarna är bortslösade. Efter ett barslagsmål 1839 hamnar Tenner i finkan och sitter två år för dråp.\r\n\r\nEfter avtjänat straff relokerar Tenner till Little Rock, Arkansas där han som nyligen reformerad åter hamnar som utkastare på salooner. Battle Row är ett smutsigt område för dom fattiga och livet är hårt. Den låga lönen drygas ibland ut med ett och annat personrån.\r\n\r\nHan jobbar sig sedemera upp till bättre salooner med bättre lön.\r\n\r\n1845 Hamnar Tenner i en dispyt med en man som anfaller honom med en kniv. Tenner skjuter honom mitt mellan ögonen, i självförsvar. Lagen tycker dock annorlunda. Tenner har ingen lust att hänga eller sitta inne så han fly västerut.\r\n\r\nI Nebraska, vid Platte River, slår han sig ihop med ett vagnståg på Oregonleden för att starta ett nytt liv västerut.\r\n\r\nMellan 1846 och 1847 så genomlids allehanda mödor och prövningar som kulminerar i det fantastiskt usla vädret som gör att hela expeditionen snöar inne. De flesta dör men Tenner klarar sig dock.\r\n\r\n1848-1851 Försöker sig Tenner på prospektering men inser snart att det är enklare att stjäla guld än att gräva upp det. Han jobbar som olika former av vakt, hyrd flåbuse och stråtrövare.\r\n\r\n1851 drar Tenner på sig en stor spelskuld och då han inte har råd att betala så blir han tvungen att bege sig österut. Tenner lämnar ett brottsligt spår efter sig i New Mexico, Colorado och Kansas där han tar sig från stad till stad, ibland själv och ibland med andra.\r\n\r\n1859 kommer han till guldgrävarstaden Denver City och börjar i vanlig i ordning med att jobba som vakt och hyrt vapen samtidigt som han emellanåt kliver över gräns för vad som är lagligt. Bl a lyckas han, och ett antal andra laglösa, komma över en lönelåda från en diligens på väg genom Arapahoe County. Pengarna slösas bort på nya kläder, whisky och spel.\r\n\r\n1861 när inbördeskriget bryter ut är det dags för Tenner att försvinna. Lagen har ändå blivit alldeles för organiserad inom territoriet. Kriget är inget för Tenner. Han är uppfödd i södern och anser att det hela är blåst ur proportion, dock ser han möjligheter att återvända hemåt där nu hönshuset lämnats öppet för räven.\r\n\r\n1863 befinner sig Tenner åter i ett slagsmål på en saloon men denna gång har det inte gått hans väg. En person får övertaget över Tenner och sitter på honom på golvet med en revolver riktad mot hans huvud. Plötsligt skriker personen till och faller död ned över Tenner. Ur ryggen sticker handtaget till en kniv. Tenners liv räddas av Penny(Emma Ström), och de två påbörjar en briljant karriär tillsammans där Penny lånar ut pengar till ockerränta och Tenner kasserar in med ränta. Efter en tid så berättar Penny att hon vill återvända till sitt forna gäng. Tenner är tveksam då han sällan har gått bra ihop med andra men det får bli som hon vill.\r\n\r\nTenner har svårt att acklimatisera sig i gruppen. Alla blir förbannade på honom för allt möjligt, stort som smått. Det kommer till en nivå då han skiter fullständigt i vad alla andra säger. Mcdougalls leds av en Cormac Mcdougall som försöker snacka med Tenner men hans beteende går fortfarande inte ihop med övrigas. Det slutar med ett riktigt rallarslagsmål. Cormac vinner fighten men båda hamnar i sjuksäng med brutna revben, spräckta ögonbryn osv. En del säger att Cormac vann på ren tur men för Tenner så var det en vändpunkt där Cormac visade hur mycket han brydde sig, inte bara om sitt gäng utan även, om Tenner. Varför skulle han annars ha låtit honom leva? Efter detta var det ingen tvekan om vem som var boss; Cormacs ord är lag. I ett senare läge bevisar Tenner för gänget att han verkligen är att lita på då han sköter sig under ett tågrån som Mcdougalls genomför. Han går dock fortfarande en del av gänget på nerverna.\r\n\r\n\r\nTenner är av den usla combon usel spelare som gärna spelar. Han är en provokatör med dåligt sinne för rusdrycker. En hård barndom och uppväxt har gett honom en övertygelse att det är viktigt att gå hårt ut.\r\n\r\nMycket som kommer ur Tenners mun är förmodligen skitsnack. Hur han sköt en någon i Little Rock för att personen tittade konstigt på honom, att han säger sig veta hur långgris smakar, att han en gång smet från en stor spelskuld eller att han blev såld till hårt arbete för en dollar när han var 12 år gammal.', 'Tenner blev utsedd till sheriff.\r\nPå jullajvet så vann han en \r\nbudgivning angående en middag med Black Belle.', 'Han bor, arbetar och har sitt gäng i Slow River.', 'Protestant', ' Tenner är korrupt och har ingdt emot att släppa brottslingar mot betalning', 'Det ordnar sig nog.', '', '', '', 33, 3, 3, 1, 'USA, Arkansasterritoriet, Arkansas Post', 'Cormac, Tenners boss\r\n', 1, NULL, 'Clarence \"Tenner\" Tanner\r\nClemens “Tenner” Tanner\r\n\r\nFödd i Arkansas Post, Arkansas te