stort som smått. Det kommer till en nivå då han skiter fullständigt i vad alla andra säger. Mcdougalls leds av en Cormac Mcdougall som försöker snacka med Tenner men hans beteende går fortfarande inte ihop med övrigas. Det slutar med ett riktigt rallarslagsmål. Cormac vinner fighten men båda hamnar i sjuksäng med brutna revben, spräckta ögonbryn osv. En del säger att Cormac vann på ren tur men för Tenner så var det en vändpunkt där Cormac visade hur mycket han brydde sig, inte bara om sitt gäng utan även, om Tenner. Varför skulle han annars ha låtit honom leva? Efter detta var det ingen tvekan om vem som var boss; Cormacs ord är lag. I ett senare läge bevisar Tenner för gänget att han verkligen är att lita på då han sköter sig under ett tågrån som Mcdougalls genomför. Han går dock fortfarande en del av gänget på nerverna.\r\n\r\n\r\nTenner är av den usla combon usel spelare som gärna spelar. Han är en provokatör med dåligt sinne för rusdrycker. En hård barndom och uppväxt har gett honom en övertygelse att det är viktigt att gå hårt ut.\r\n\r\nMycket som kommer ur Tenners mun är förmodligen skitsnack. Hur han sköt en någon i Little Rock för att personen tittade konstigt på honom, att han säger sig veta hur långgris smakar, att han en gång smet från en stor spelskuld eller att han blev såld till hårt arbete för en dollar när han var 12 år gammal.\r\n', 'Tenner är sheriff i Slow River.\r\nIbland dricker han lite men oftare mycket.\r\nMycket som kommer ur Tenners mun är förmodligen skitsnack. Hur han sköt en någon i Little Rock för att personen tittade konstigt på honom, att han säger sig veta hur långgris smakar, att han en gång smet från en stor spelskuld eller att han blev såld till hårt arbete för en dollar när han var 12 år gammal.', 0),
(29, 'Mrs Anna Belle Rose', 0, 'Dotter till en bättre familj. Änka efter officer. Ärvde oväntat mkt pengar av maken som hon bl a startat ett företag av import av dyrbara spetsar från England. Idkar välgörenhet. ', 'Mrs Rose var gift med officer Thomas White i ett barnlöst äktenskap. Hon träffade honom när han besökte hennes bror i Bath och flyttade med honom till Amerika. På slutet av äktenskapet mådde maken psykiskt dålig pga krigsuppleverlser och distanserade sig. Han dog strax efter kriget på en ridtur där han hittades livlös efter ett slag mot huvudet i närheten av Denver där de bodde. Det visade sig att hon ärvde mer pengar än hon trodde. Hon tog kontakt med General Bailey som var makens överordnade och bad om hjälp att ta nästa steg i sin framtid ev flytt tillbaka till England eller ett liv på egen hand i New York. De möttes i Slow River och han eskorterade henne till New York. Hon har nu etablerat sig i New York och blivit introducerad i goda kretsar. Hon trivs och har startat sitt importföretag av spetsar som överklassens sömmerskor gärna beställer av hennes anställda Mrs Andersson. Mrs Rose har en bror och en svägerska kvar i Bath. De äger några mindre gårdar som rättare sköter samt ett säteri där dom bor. Mrs Rose vill gärna träffa en ny man. Hon är stolt över sitt lilla företag och kan tänka sig även utveckla, kanske exklusiva doftande tvålar etc. ', 'Mrs Rose har varit i Slow River tidigare (se tidigare text). Senast var på julfesten och hon ville ge byn en donation till något behjärtansvärt. Hon sökte upp Mr Orsini som hon visste hade bekostat julfesten och berömde honom för att vara byns välgörare och änkors och faderlösas beskyddare och som sådan ville hon ha råd vad göra med pengarna. Det visade sig att en skola var under uppbyggnad så hon valde att donera 100 dollar som hon gav till Borgmästaren. \r\nHon gav alla i byn en julklapp och till just gruppen kring McDougalls blev det varsin tvål. Nu visade det sig att tvålen var av exklusiv sort och i ett samtal med William R. White (Doc) så undrade han hur man tillverkade just dessa tvålar och om tillverkning skulle gå att få till stånd här. Huvudingrediensen är Rapsolja och han var intresserad av att odla raps och starta en tillverkning av exklusiva tvålar, ev kunde Mrs Rose vara behjälplig med att välja råvaror och dofter samt sätta upp försäljning även i New York kanske. ', 'När hon stod själv och inte visste var hon skulle fortsätta sin väg i livet så mötte hon General Bailey i Slow River och efter det började ett nytt kapitel med att etablera sig i New York, få nya vänner och starta företag. I Slow River började det nya livet och i Slow River kan en kvinna vara mer fri än hemma, äta på gatan, sjunga visor, dricka med roliga människor och röka Cigarr. Saker hon uppskattar men som hennes ställning inte skulle medge hemma. ', 'Kristen Anglikanska kyrkan. ', ' Varifrån kom pengarna som maken lämnade efter sig i arv. Vad hade han gjort som gav dessa pengar och varför mådde han så dåligt i slutet av hans liv. Dog han en naturlig död genom ett fall från hästen eller hände något annat. ', 'Skapa skav genom att något avslöjas kring vad maken gjorde eller var pengarna kom ifrån. Ge henne sorg eller skam över maken. ', 'Det skulle vara roligt om hon blev lite uppvaktad av någon som kanske såg henne som ett gott gifte eller som ville åt pengarna på ett enkelt sätt. \r\nDet skulle också vara kul att få komma några spelare nära som vän, få göra någon en mycket stor tjänst eller få betyda mycket för någon, skapa band. ', 'Inte svika någon som står henne nära. ', '', 35, NULL, 4, 6, 'England, Baath. ', 'Brigadgeneral Joseph Bailey -  han uppvaktar Mrs Rose och är hennes beskyddare efter makens död. \r\nMr Orsini  - han och borgmästaren har fått en donation för att bygga en skola. Hon verkar ha fått för sig att Mr Orsini är byns välgörare och änkors och föräldralösa barns beskyddare. Iomed detta började Mr Orsini se sig som det eller rättare sagt möjligheterna det ger.\r\nMrs Magnolia Malone och Mrs Ophelia O\'Shannon har blivit väninnor.  \r\n\r\n', 1, 7, '', 'Mrs Rose är en änka med fin bakgrund och pengar på banken. \r\nHon har startat litet importföretag och tar hem vackra spetsar från England. Hon är en god lyssnare som många anförtror sig åt och ber om råd. \r\nLite mer äventyrlig än kvinnor i hennes situation borde vara, älskar en god cigarr och ett glas sherry eller portvin. Har fina minnen i Slow River så byn har en särskild plats i hennes hjärta. ', 0),
(30, 'James Hogg', 0, 'Alltiallo för Revisor och Co', 'James Hogg är från en by strax utanför Aberdeen där han vuxit upp med sin mor och yngre bror och syster. Han har försörjt sig på diverse ströjobb men efter att ha hamnat i klammer med rättvisan en gång för mycket så valde han att emigrera till USA dit han nyligen anlände och har därefter tagit anställning hos Revisor och Co som alltiallo.\r\n\r\nJames kan vid första anblick verka ilsk och hetlevrad. Han gillar att spela tärning och kort men mest håller han till dom han känner till så länge du inte bjuder på något gott att äta eller dricka.\r\n', '', 'Företaget som James jobbar för har rest hit', 'Protestant', ' Droppen som fick bägaren att rinna över i Skottland och ledde James till att han emigrerade är att han blev påkommen med att stjäla ett lik från en kyrkogård som han skulle sälja till en anatomiprofessor. James skulle föredra att detta aldrig nämns igen. ', 'Kan spela på detta genom att kunskap om detta på något sätt nått Slow River', '', '', '', 29, 7, 2, 8, 'Skottland, Aberdeen', '', 1, NULL, '', '', 0),
(31, 'Hans Focher', 0, 'Läkare', 'Vilsen tysk läkare. Letar efter sin dotter  Astrid Focher. Ryktet säger att hon gift sig med en Amerikan på västkusten. ', '', 'Han letar efter sin dotter. Ryktet säger att det finns en person i Slow River som vet vart hon blivit av. ', 'Protestant', ' Hans må vara på pappret läkare, men bara synen av blod får han att skaka och till och med svimma. ', 'Låt han ta hand om skador', '', '', '', 17, NULL, 3, 7, 'Tyskland', '', 1, NULL, '', 'Nervous German Proffesor. Doctor with a shaky hand.', 0),
(32, 'Patrik O´Reiley', 0, 'är för tillfället inhyrd av Hilda Johansdotter och Tessie O´Rourke som säkerhet då deras reser runt mycket.  Är även prisjägare', ' Har även rätt hett temperament och ser ofta aggressiva lösningar som bra lösningar.\r\n uppvuxen en kort tid på barnhem innan jag flydde med hjälp av min före detta partner\r\n', 'har ej deltagit tidigare år', 'anställd som beskydd av revisor och compani och är på jakt efter en före detta partner som jag vill ställa inför lagen', 'protestantisk kristen', ' har begått flertalet krigsbrott under amerikanska revolutionen.\r\n sköt både min mor och min far när jag var endast 11 år gammal då dom under många år misshandlat och torterat mig, hamnade på barnhemmet pga dessa mord\r\n', 'är öppen för idéer ', ' är på jakt på min gamla kompanjon/partner då han har hamnat på andra sidan lagen efter att ha föråt mig, har nu en hemlig agenda och är nu ute efter hämnd genom att få han inspärrad.\r\n har även en del folk som har skulder till mig efter tidigare jobb så är även ute efter att driva in dessa skulder.\r\n', 'kärlek', '', 31, 7, 3, 8, 'Dallas, Texas, USA', ' Är en allmänt hård och professionell prisjägare/legosoldat. Är vad många skulle beskriva som en \"lone ranger\" då min sen länge förlorade partner förrådde mig och lämnade mig till att dö. livnär mig just nu som säkerhets skydd för revisor o compani då företaget reser mycket och är i behov av extra beskydd. ', 1, NULL, 'allmänt kall och lite \"grumpy\" men när det väl kommer till krita så finns jag såklart där för dom andra (har ju trots allt betalt för det)', 'är en omtalad prisjägare och lego soldat som är högst professionell och en kall hårding. har även ett ryckte för att vara lätt irriterad och kan ibland spåra ur till att våldsam p.g.a detta. \r\n rycktas även om att jag är på jakt efter någon i Slow river.\r\n', 0),
