(38, 'Annabelle', 0, 'Står för mycket av hushållssysslorna i FF, men är lika ofta med i att råna/mörda som tvätta/laga mat', 'Mera kommer', '', 'Affärer och håller sig borta från lagen.', 'Icke troende Mormon', ' ', 'Kontakta Simon Erlandsson för intrig kring hemligheten', '', 'Att jag får plotter mot min grupp, vända sig mot FF', '', 39, NULL, 2, 8, 'America, Michigan, settlers fort', 'FF är hennes familj som hon kan offra allt för.\r\n\r\nRuth (Macevans?), Annabelle söp ner henne på whiskey förr förra julen. \r\n\r\nPeter, hennes bror som skickades till Salt Lake City.', 1, NULL, '', '', 0),
