(41, 'Sally ”Sal” Marsh', 0, 'Jägare', '33 år gammal, kvinna med maskulint uttryck\r\n\r\nUppväxt i Floridas wetlands med pappa och fem syskon. Familjen tjänade pengar på bland annat stöld, tjuvjakt och svindel. Levde ganska knapert och var väldigt ”livets hårda skola”\r\n\r\nMedlem i Five fingers sedan hon var 16.\r\nSlagsmål i en saloon hände pga FF lurade henne på pengar på något sätt. Bets were made. Sal vann. Hon bondade med gänget över kopiösa mängder rusdryck. Sedan hängde hon med dem eftersom hon ändå ville ta sig bort från den där hålan hon växte upp i.\r\nHon visar sig användbar för FF genom sin talang för spårning (främst i våtmarker) och kunskap om fiske och furagering, men hon är också erfaren med skjutvapen och klarar sig bra i handgemäng. \r\nHon verkar vilja bli lärare! Det ska ju starta en skola i slow river. Hon är DEFINITIVT inte passande, men det fattar ju inte hon. \r\n\r\n\r\n', 'Sal var med och firade jul (våren ’23) och då skrev hon en kärleksdikt till Sheriffen och slog en soldat på truten. Utöver det, nej.', 'Sally är med i Five fingers och dyker således upp i Slow river när FF gör det.', '', ' Sal är rädd för att bli övergiven. Hennes värsta mardröm är att Five Fingers ska utesluta henne.', 'Något som ger henne dilemma över huruvida lojaliteten till FF är värt det? Vet inte ', 'Sal har säkert gjort sig osams med någon! Antingen så har hon lurat dem på pengar, slagit ner dem eller bara varit dryg. Kan tänka mig att ha en fiende! (Fast inte dödsfiende. Vill inte dö)\r\nSal har bestämt sig för att bli lärare. Sal borde kanske gå i skolan först.\r\nSal vill slåss!', 'Politiska intriger och handel håller inte Sal på med', 'Sal är med i Five Fingers, men jag tror inte att gruppen registrerats ännu! Flyttar henne sen när jag kan. Om jag kan.', 37, NULL, 2, 6, 'USA, Florida,??', 'Alla i Five Fingers!\r\nBlev polare med Sheriff Tenner i julas. ', 1, 11, '30 år gammal, kvinna med maskulint uttryck\r\n\r\nUppväxt i Floridas wetlands med pappa och fem syskon. Familjen tjänade pengar på bland annat stöld, tjuvjakt och svindel. Levde ganska knapert och var väldigt ”livets hårda skola”\r\n\r\nMedlem i Five fingers sedan hon var 16.\r\nSlagsmål i en saloon hände pga FF lurade henne på pengar på något sätt. Bets were made. Sal vann. Hon bondade med gänget över kopiösa mängder rusdryck. Sedan hängde hon med dem eftersom hon ändå ville ta sig bort från den där hålan hon växte upp i.\r\nHon visar sig användbar för FF genom sin talang för spårning (främst i våtmarker) och kunskap om fiske och furagering, men hon är också erfaren med skjutvapen och klarar sig bra i handgemäng. \r\n\r\n- Duktig på att fiska och att spåra i våtmarker.\r\n- Bygger schyssta fällor! \r\n- Har svårt att visa tillgivenhet och kan framstå som kylig men är väldigt beskyddande och lojal till FF.\r\n- ”Tvål är onaturligt”\r\n- Är ganska våldsam, men föredrar kall hämnd framför att låta känslorna styra i stunden. (Ask questions first, shoot later.)\r\n- Knows her way around a gun.\r\n- Slagsmål är ”en kul aktivitet” i första hand. \r\n- Gillar inte att bli kallad för ”miss” ”fröken” eller ”damen”\r\n- Kan inte läsa, men känner igen viktiga ord som ”whiskey” och ”gunpowder” \r\n- Tycker att spets är det mest värdelösa som finns.\r\n- Hon kallar allt som inte är majsgrynsgröt för ”fancy food”\r\n', '30 år gammal jägare/spårare/fiskare som tycker att slagsmål är ”en kul aktivitet”.\r\nÄr från Florida och är definitivt inte den vassaste hästen i lådan. Ogillar att bli kallad för ”miss” (och det mesta annat som inte är hennes namn) \r\nGillar whiskey, skjutvapen och att slåss.', 0),
(42, 'Malcolm Reynolds', 0, 'Ranchägare, sysslar med diverse affärer, farm skogsägare gruvdrift mm. Före detta prisjägare men tar ibland uppdrag från Junk City', 'Tidigare prisjägare, numera Ranchägare\r\n', 'Hittade min fru Kate här som jag trodde var död\r\nGjorde riktigt goda affärer och utökade farmen igen.\r\n', 'Göra affärer och tjäna storkovan. Det gick inte så bra i början men nu har det kommit igång med både farm, ranch, skog och gruva.', 'Kristen, protestant', ' Skulle dö för Kate, även om hon tidigare försökt mörda mig, då hon är den enda som faktiskt lyckats sol och våra mig.\r\nHar börjat se dåligt på långt håll så undviker eldstrid så mycket det går. ', 'Vet ej, kanske kommer på något.', '', '', '', 38, NULL, 4, 1, 'England, på gränsen mot Skottland', 'Kate Reynolds (Min hustru)\r\nBurt Reynolds (min bror)\r\n', 1, NULL, 'Vill göra goda affärer och luras sällan. Vill uppfattas som trovärdig och står fast vid löften.', '', 0),
(43, 'John Cody Mason', 0, 'jobbar i familje företag Mason transport&shipment LTD', '1-11\r\nCody föddes i Birmingham till ett hem med lite pengar och lärde sig att pengar får man arbeta för, vid tidig ålder jobbade på gården. \r\nHan började skolan med stulna skolböcker från en affär allt för att inte fastna i fattigdomen, efter en olycka som skadade Alice svårt blev Cody tvungen att välja mellan skolan \r\neller gården och skolan så han valde skolan. Efter ett blixtnedslag bran ladan ner och maten, alternativen blev få och Cody vid 8 års ålder var tvungen att arbeta. \r\nFabriken som tillverkade papper var tuff med långa timmar, skador var vardag och han fick en del egna nästan krossa handen men kom undan med en fingertopp. 10 år gammal \r\ngick han till hamnen som sin far och mor, mamma i tullkontoret o far på lagret så tillgång till tullens böcker som gjorde att iden om vad saker var och gick till. Detta fick leder till \r\ndom första affärerna med \"bortkomna \" stulna varor, när pappa blev befordrad till för lagren hade Cody byggt upp sin handel av varor från lagret med beslagtagna laster. \r\nKontrollen var så dålig att ingen kollade och andra tog samma chans, vad som fanns såldes till höger och vänster, gäng bildades och slagsmål började över vem som hade rätt till vad. Detta fick uppmärksamhet när kontrollanter kom och undersökte varför smuggelgods var borta, Cody kom undan i sista sekunden med familjen genom att bränna alla spår. En affärsman såg Fredric’s vilja att arbeta och gav familjen Mason arbete, Cody’s syster var mer känd som “boken flickan” var inte bättre och hade många stulna eller “hittade” gillade att skriva. Hennes skola var bara för flickor förstod att man inte kan lägga sig för dom starka, man måste slå där dom faller lärde sig hon av sin bror. Men också att gränser går att böja, på rätt ställen. \r\n\r\n12-15\r\nVid 12 års ålder följde Cody med ett skepp till Amerika som last hand, han gillade inte sjön men allt gick bra över och hans ögon öppnades för en ny värld. Varor som kostade mycket hemma var billiga så några extra lådor kom med hem till, Fredric’s chef såg vad som kommit med hem och köpte allt. Detta blev öppningen för familjen att själva investera och göra lite pengar, Dom första åren gick sakta men tog sig, chefen som började bli gammal lät skata familjen ta över verksamheten. Alice skador började märkas igen, men nu fanns pengar, brist på mat var inget. Familjen hade tagit steget upp i samhällets elit och även gäng såg dom, Cody som för första gången blev arresterad för olaglig affischering för gänget black Ravens. Han kom snabbt ut med hjälp av gänget från insidan, första slagsmålet kort efter och festen efter, med jobbet och gänget kom status som Cody kom lite längre med dock med hållen försiktighet. Även lagen har ögon och öron i nacken, den går med att köpa märktes och kontrollen kan undvikas. Black ravens var kända för sin ärlighet och tog inte på sig nåt dom inte gjort utan att gå i parle för att undvika krig mellan gängen. Fred var viktig för att inte lagen skulle komma till ens dörr. När Cody fyllde 15 tog familjen över företaget och klev upp på stegen, investerar pengar och köper tillbaka gården som blev tillhåll för stöldgods och annat långt bort från lagen nära kanalen för transport.. \r\n\r\n16-21\r\nCody under åren från 16 till 19 tog ett jobb på flera skepp, och reste till flera länder runt europa men även till USA. Sen blev det inte bara till hamnen men inåt i landet, New york blev lite av ett andra hem och en liten lägenhet i staden NY köpes. Medan han slet hårt på skepp tog gänget över mer av “North Sulton”, familjen hem och kontor hamnade i ytterkant av området med gården. Detta gjorde att familjen kom mycket närmare, koppling mellan familjen var redan stark efter en överenskommelse att importera eller exportera med gården och flera punkter med lager vid kanaler punkter gick ihop. Pråmar till och från flera städer gick ofta mella städerna, allt för att lagen inte skulle hitta nåt eller märka av det. Alice och Fredric, hamnade i problem med andra gäng som också såg vad Black ravens höll på med. några hot kom men freden höll saker lunga.Det var inte förrän cody com hem efter han fyllde 20 som jobben från gänget och det mer kriminella livet började. Några små saker hade gjorts i NY, mycket “borttappat” gods hade gått tillbaka med skeppen under flaska papper genom säkra hamnar till knutpunkter. Pråmar gick under natten till dessa punkter för att hämtas, ett nätverk som hölls hemligt till några personer. En övergiven industri kanal punkt köpes för omlastnings område, gods frå hamnar på på öst och västkusten kom in och med detta kom även ovälkomna ögon. Både från lagen och gäng som så möjligheter, sånt som inte uppskattas när man ska hålla saker under ytan. Cody arbetade med a hålla en punkt från en stenstuga, med vapen gömda för vad som kunde ske och gjorde. Flera konfrontationer utspelade sig runt punkter utanför staden, lagen kom också ut ibland för att kolla saker men det var tydligt hur den kom för andra saker. \r\n\r\n22-35\r\nVid 22 års ålder hade Cody sin egen stuga och familjen hade för några år sen klivit upp i den höga klassen, många nya kontakter hade bundits med rika handlare. Dom rika ville ha fina saker som från europa och Amerika, Sverige hade fallit på svåra år och många emigrerade. Många kom genom England, flera stannade men dom var få med den stora delen drog vidare med skepp till det nya landet. Familjen Mason såg även många slavar komma igenom men skeppade aldrig några, kriget kändes av även i England på flera sätt. Med kriget kom fler kontroller, även om företaget hade licenser för handel skulle även gods som inte fanns på papper börja fastna i tullen mer än förut. Familjen inte tog någon värvning i något militärt,Cody hade haft koppling till gängen och det kriminella som familjen hade med. Eliten var lika smutsig som dom fattiga, med kopplingar till lagen eller kriminellt folk. Politiker stod på båda sidorna, Cody visste lika väl som familjen att alla kunde köpas eller hållas under hot för att lyda. Cody hade inte haft mycket med gänget att göra men det ändras med tiden och han blev med sin syster mer aktiva, saker behövdes göras och kriget mellan gängen som börjat växa innan Cody fyllt 19 under åren på havet eller i Amerika. Familjen Mason är bara en kugge i gänget makt och tillgångar men högt på listan, med tillgångar och möjlighet att tvätta pengar eller transportera gods på sidan av det vanliga jobbet. Men cody var inte nån som tog jobb för för att döda, om han var tvungen så tog ha dom jobben men inte med ett leende. I självförsvar var en sak men helst inte i helt kallblodigt om det inte var någon som behövde dö så gjordes det.                            \r\n\r\n\r\n\r\n', 'nej ny roll', 'För att hitta nån som har tagit pengar från gäng medlemmar från Black raven ska ska hitta personen och ta tillbaka pengarna.  ', 'gud har glömt bort mig, djävulen vill inte ha mig.', ' Gäng medlem i Black Raven, och dess bakgrund   ', 'gäng koppling ', 'För att hitta nån som har tagit pengar från gänget och medlemmar från Black raven ska ska hitta personen och ta tillbaka pengarna.  ', 'sälja ut sin grupp ', 'Cody är enbart baserad på iden av serien Peaky blinder men inte på nåt sätt familjen från serien, kläderna kommer att vara nära serien that is it. ', 42, 10, 4, 7, 'England Birmingham ', 'mamma: alice Johanna Evans \r\npappa: Johan Fredric Evans \r\nSyster/släkt: om Julia kommer\r\nPälsjägare: spelad av Rikard kopplad till gruppen  \r\n', 1, NULL, 'Del av familjen Mason från England, och delägare Mason transport&shipment ltd.  Kan vara kall, kan vara synisk eller trevlig.    ', 'inte mycket, hans kläder sticker ut.', 0),
(44, 'Eufemia Carnegie', 0, ' Hustru t Andrew Carnegie, stål och järnvägsmagnat', ' Jag vill gärna att Eufemia har släkt i Slow River. \r\nNågot som Eufemia inte pratat så högt om är att hon innan hon gifte sig med Andrew haft en kort förälskelse. Det vore ju pinsamt om han dök upp!', ' Ny karaktär. ', ' Jag ska ordna arbetsgivare till de barnhemsbarn som uppnått arbetsför ålder (från 6 år)\r\nJag kommer ha med fotografier på barnen och uppgifter om vad de kan. \r\nSedan kan man teckna sig och lägga handpenning på barn som levereras senare. ', ' Presbyterian', ' Obs att jag är rik innebär inte att jag strör pengar omkring mig. Förmögenheten tillhör min make rent juridiskt. \r\nAtt hon haft ett föräktenskapligt förhållande. Det får inte komma ut. \r\nDottern Margret börjar bli svår att tygla. Det får heller inte komma ut. \r\nFör en tid sedan försvann en dyr brosch och i ilska fick hembiträdet gå utan lön. \r\nEufemia hittade sen broschen men gjort var ju gjort. ', ' Avslöja eller utpressa. ', ' Vore kul att bli kidnappad eller åtminstone utpressad. ', ' Hon är nog rätt skrupelfri framförallt om man hotar hennes position. ', '', 44, NULL, 4, 3, ' Amerika New York', ' Maken Andrew Carnegie. Kan ju bli inblandad om hustrun blir rånad, utpressad eller kidnappad. \r\nDottern Margret 12 år. Kan också användas för utpressning. \r\nMR Orsini bedriver tydligen verksamhet för fattiga barn. \r\nEftersom Eufemia är ordförande i Denvers fattigvårdsstyrelse skulle hon kunna tänkas ha tillsyn över verksamheter i Minekapi somnhandlar om barnhem, fosterhem och fattighus. Dvs Orsinis verksamheter. ', 1, NULL, '', ' De flesta i byn vet nog att de som är släkt med mig är det för det har de nog skrutit om. ', 0),
(45, 'Adeline Monaghan', 0, 'Sekreterare', 'Adeline är 24 år och är född i Queens, New York men är ättling i tredje generationen till irländska invandrare. Hon växte upp i en ganska fattig familj med sina föräldrar Cormac och Marilyn Monaghan och bror Oisín. När hon var 16 så ljög hon om sin ålder och sa hon var 18 för att kunna gå med i arméen för att försöka hjälpa till att försörja dem. I arméen så blev hon placerade i the 2nd New york heavy artillery regiment där hon mötte de som kom att bli hennes kamrater i strid och sedan vänner. Hon blev efter ett tag befordrad till lance corpral. Hon och de andra stred under inbördeskriget i bland annat slaget om the Battle of the Crater, där hon räddade en skadad Charlie Arlington från döden, men händelsen har minst sagt satt sina spår på henne och de andra. Det var även dessa vänner som tillsammans efter inbördeskriget bildade det företag, som hon nu jobbar som sekreterare hos, nämligen Arlington and Fletchers land survey co. med Benjamin Fletcher och Charlie Arlington i spetsen. Där hon även den sen den senaste tiden skött handeln och en del avtal för företaget.  Innan lajvet 2022 så gick hon även med i Frimurarorden och varit aktiv på mötena med den del av organisationen som varit i Slow River. ', 'Tog emot pengar från Walter Kirk som han tagit i ett bankrån för att kunna köpa tarmvredsmedecin åt sin far som hon sedan skickade. \r\n\r\nHon tog emot pengar (700 dollar) från Mcdougle för att se till att Anne White blev senator, även om hon redan innan bestämt sig för att göra det. Samt några andra mutor från andra. \r\n\r\nHar även ett kontrakt med McDougle om att Arlington och Fletcher ska få utökat beskydd vid ett tillfälle. \r\n\r\nHon såg till att flertalet landområden blev uppgraderade och tjänade ganska mycket pengar å företaget vägnar genom handeln. \r\n\r\nHar blivit lovad en proportionerlig tjänst av Anne White. Då hon såg till att hon fick valdistriktet som senator. Något som senatron först ville belöna henne med att stötta henen som kanditat i borgmästarevalet något hon tackade nej till. Detta kan i sin tur lett till att senatorn stöttade McDougles istället... \r\n\r\nLyckades rädda undan järnvägen från sprängning genom sin kontakt i frimurarorden, Frank Fierce. \r\n\r\nAdeline och Fiona B. Cecil blev rånade av en bandit från Wolf brothers i sitt hus. Men Adeline lyckades skjuta ner banditen innan den hann komma långt och som låg skadad länge innan hen dog medan Adeline försökte pressa hen på information, utan någon vidare lycka. De fick tillbaka pengarna iallafall.\r\n\r\n', 'Då företaget nu äger land i området som de då egentligen köpte å Arthur Fords vägnar, men då han dött så har de fortfarande kvar landområdena. De  hoppas nu kunna tjäna pengar på denna mark genom att förhoppningvis bygga ut och få igång stickspåret som ligger på marken, kombinerat med deras fortsatta lantmätaruppdrag, har gjort att de blivit kvar i området.\r\n', 'Katolik', ' Adeline har under kriget varit med och begått krigsbrott genom att ha brutalt dödat ett antal civila som arbetade för sydstatarna, genom att bombardera en gruva med artilleri eld inte så väldigt långt ifrån Junk city.\r\n', 'Det kanske kommer någon som kände en av de som dog i attacken och söker vad som egentligen hände och vill ha rättvisa. Eller så kanske en motståndare till lantmätarna har hört rykten...', 'Adeline vill försöka genom frimurarna att få in en fot i McDougles makt stege. Eller försöka få bort någon av dem. Detta då det på sikt kan skada affärerna att ha några som är så mäktiga och i princip orubbara för mutor och påtryckningar.', '', '', 45, 5, 4, 6, 'USA, New York, New York City ', 'Oisín Monaghan (bror, spelar-karaktär) som hon nu inte sett på tre år. Har haft en bra relation men han vet inte så mycket om hennes tid som soldat men märker att det förändrat henne, men till vilken grad och på vilket sett är frågan?\r\nCormac Monaghan (far, bakgrundkaraktär) har inte setts på flera år, bryr sig om henne, väldigt kristen, hade tarmvred tidigare som hon skickade medecin för med inte helt rena pengar (från ett bankrån), om han skulle få reda på det skulle han kanske ha ett problem med det då han är polis. \r\nCharlie Arlington (vän, spelar-karaktär) den som fått henne dit hon är nu, vet inte om det som hände under förra året (2022) och kanske inte skulle hålla med om allt där, vad skulle hända om Charlie fick reda på vissa saker?', 1, NULL, 'Något stram och gör inte mycket väsen från sig oftast, något som gör henne disket vilket kan vara behändigt när olika avtal ska skrivas men hon är något kall och det är inte ofta man ser några känslor. ', 'Adeline Monaghan, sekreteraren från lantmätarna ses oftast gående med sin bruna, portabla, skrivdons väska, alltid redo för att skriva kontrakt. Hon verkar vara en kall och allvarlig affärskvinna som till synes inte räds någon, inte ens James Orsini. Har tiden som soldat under kriget gjort henne modig eller bara avtrubbad? ', 0),
(46, 'Kit Reed', 0, 'Beskyddare/Livvakt och diligens kusk', 'Beväpnad vakt och föredetta pinkerton agent. Hon lämnade yrket på grund av allvarliga hot mot hennes familj från olika gäng och faktioner, något som hon delvis fortfarnade har efter sig. Hon söker sig nu till arbeten som dillegens kusk eller vakt för de som inte har allt för nära kontakt och i gängens business. Skulle däremot en öppning till hämnd och fastagande av de gäng som hotat henne och hennes familj framställa sig så skulle hon glädjeligen ta den, om inte modet sviker. Hon har dock sett mycket här i världen både under och i efterdyningarna av inbördeskriget, något som gjort henne något avtrubbad kring vad som är rätt och fel. Hon har sett hemskheter på alla sidor och följer därför sin egna moraliska kompass och tar de jobb som bäst följer den. Något som för tillfället lett henne till Arlington & Fletchers Landsurvey co. \r\n', '', 'Har nyligen fått anställning som beskydd för företaget som just nu primärt befinner sig i byn. ', 'Protestant, Baptist', ' Under ett uppdrag som beskydd och diligens kusk hon gjorde för några, vad hon tyckte, riktigt odrägliga typer som förmodligen inte skulle betalat henne ändå. Så tog hon ena hästen och övergav dem på en väg när hon såg att några indianer var på väg mot deras håll. De överlevde nog inte eller så blev de tillfångatagna, oavsett så gjorde det inte henne något. ', 'Det hade nog inte varit så bra för hennes tillitlighet om detta kom ut, speciellt för hennes nuvarande arbetgivare...', 'Någon från ett av gängen som hotat henne och hennes familj är i området.', '', '', 45, 5, 2, 6, 'USA, Michigan, Saginaw', '', 1, NULL, '', '', 0),
(47, 'Joseph A. Bailey', 0, 'Brigadgeneral', 'Krigsveteran som blivit pappersvändare.', 'Bailey uppvaktar änkan Rose.', 'Passerar igenom på väg till andra ställen.', '', ' Klart han har, jag vet bara inte vad. Troligen något från exempelvis Seminolkrigen. Han har dock inte stuckit under stol med något så det är ingen hemlighet.', 'Det är svårt när det inte ska vara några intriger.', 'Jag vill inte ha spel på intriger.', 'Vill undvika farligt spel.', '', 46, NULL, 4, 6, 'USA, New York, Rock Hill', '', 1, NULL, '', 'Brigadgeneral Bailey var med i flera stora slag under inbördeskriget men var redan vid utbrottet veteran från kriget i Mexico. Delar sin tid mellan West Point, Washington och att göra inventeringar av krigsförråd över stora delar av USA.', 0),
(48, 'Melanie Cochrane', 0, 'Handlare', 'Sköter handelsboden i Slow River', '', 'Bor här', '', '-', '-', '', '', '', 10, 1, 2, 1, 'Slow River', '', 1, NULL, 'Sköter handelsboden i Slow River', 'Sköter handelsboden i Slow River', 0),
(49, 'TBA', 0, 'TBA', 'TBA', '', 'Oklart än så länge', '', ' Ingen', 'Har ingen mörk hemlighet', '', '', '', 14, 1, 5, 1, 'TBA', '', 1, NULL, '', '', 0);

